INSERT INTO `Configs` VALUES (4,7,1,'Rich Payne','rdp at alphalinux dot org','Yes','Requires API A5.5-82 SRM for onboard\r\nadaptec.','2000-09-07 10:05:14',2,'Yes'),(2,8,4,'Rich Payne','rdp at alphalinux dot org','Yes','XFree86 4.0','2000-09-07 09:57:01',5,'Yes'),(3,8,4,'Rich Payne','rdp at alphalinux.org','No','Uses sym53c8xx driver.','2000-09-07 10:02:41',6,'Yes'),(5,1,4,'Rich Payne','rdp at alphalinux dot org','Yes','','2000-09-07 13:51:08',19,'Yes'),(6,7,1,'T. Weyergraf','kirk@colinet.de','Yes','Uses XFree 4.0/4.0.1 No Multihead\r\nsupport. Debian 2.2, RedHay 6.1/6.2','2000-09-08 05:11:28',8,'Yes'),(7,7,1,'T. Weyergraf','kirk@colinet.de','No','Works 10/100/100FD Modes. Debian 2.2\r\nRedHat 6.1/6.2','2000-09-08 05:13:49',9,'Yes'),(8,7,1,'T.Weyergraf','kirk@colinet.de','Yes','Debian 2.2, RedHat 6.1/6.2.','2000-09-08 05:28:08',10,'Yes'),(9,7,1,'T. Weyergraf','kirk@colinet.de','Yes','XFree 4.0/4.0.1, Debian 2.2, RH 6.1/6.2','2000-09-08 05:30:29',5,'Yes'),(10,1,5,'T. Weyergraf','kirk@colinet.de','Yes','21143-based Ethernet. Can netboot.','2000-09-08 08:20:06',11,'Yes'),(11,9,4,'FMS Computer + Komm.sys.','infos@fms-computer.com','Yes','Works with Xfree 3.3.6 and Xfree 4.0.1,\r\nGLX hardware acceleration for G400\r\nworks with Xfree 4.0.1','2000-09-08 17:30:50',12,'Yes'),(12,20,6,'Ryan Kirkpatrick','linux@rkirkpat.net','Yes','Not sure on compat w/SRM, as the XL366\r\nhas only AlphaBIOS (newest rev of late\r\nlast year), where it does appear to\r\nwork fine. Otherwise, works great with\r\nLinux.','2000-09-08 18:36:38',16,'Yes'),(13,20,6,'Ryan Kirkpatrick','linux@rkirkpat.net','No','Not sure on compat. w/SRM as the XL366\r\nonly has AlphaBios. Newest rev of\r\nAlphaBIOS (as of late last year) can\r\nsee the SCSI chains attached to these\r\ncards, though I have never tried to\r\nboot off of them. Otherwise they work\r\njust fine. Used the NCR53C8xx kernel\r\ndriver, the same that works with the\r\nXL366\'s onboard SCSI interface.','2000-09-08 18:40:51',17,'Yes'),(14,1,7,'Doug Larrick','doug at ties dot org','Yes','','2000-09-08 20:07:51',19,'Yes'),(15,1,7,'Doug Larrick','doug at ties dot org','Yes','','2000-09-08 20:08:11',18,'Yes'),(21,2,6,'Constantine Vetoshev','constantine.vetoshev@dartmouth.edu','N/A','','2000-09-09 10:04:07',9,'Yes'),(22,2,6,'Constantine Vetoshev','constantine.vetoshev@dartmouth.edu','N/A','Bugs in the Ensoniq chipset that the SB128 uses result in hard crashes.','2000-09-09 10:06:36',14,'No'),(23,2,6,'Constantine Vetoshev','constantine.vetoshev@dartmouth.edu','N/A','Yet another piece of hardware that Alphas generally work with that crashes with the UX boards.','2000-09-09 10:07:35',5,'No'),(24,8,7,'Matt Burke','spraints1@yahoo.com','N/A','','2000-09-09 11:30:16',21,'Yes'),(25,8,3,'Charles Chandler','clc31@cornell.edu','Yes','Works in previous revisions of SRM and AlphaBIOS','2000-09-09 15:42:11',18,'Yes'),(26,8,3,'Charles Chandler','clc31@cornell.edu','N/A','Not specifically recognized under SRM but there is a Compaq HOWTO on booting from some Mylex cards under SRM.\r\nIs recognized under AlphaBIOS.\r\n\r\n','2000-09-09 15:45:46',22,'Yes'),(27,8,3,'Charles Chandler','clc31@cornell.edu','Yes','','2000-09-09 15:47:41',24,'Yes'),(28,8,3,'Charles Chandler','clc31@cornell.edu','N/A','','2000-09-09 15:50:11',25,'Yes'),(29,2,6,'Stefan Reinauer','stepan@suse.de','Yes','This card works with Linux, but it doesnt initialize correctly\r\nwith a Deskstation ARCS Bios because of the firmwares buggy ix86 emulation.\r\nUnluckily there will be no new firmware updates for the Ruffian boards.\r\nMILO initializes the card fine, so if you have an automatically booting system\r\nyou get Linux up and running even with this exotic piece of hardware.\r\nThe Revolution IV works well with SRM on other platforms.','2000-09-09 15:51:42',23,'Yes'),(30,1,7,'Dave Gilbert','linux@treblig.org','N/A','2D works fine (XFree 4), 3D still being\r\nworked on.  Needs a recent MILO/AlphaBIOS','2000-09-09 16:38:21',26,'Yes'),(31,1,7,'Dave Gilbert','linux@treblig.org','N/A','','2000-09-09 16:41:55',27,'Yes'),(32,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','Yes','XFree-4.0 required. XFree-3.6 causes hard lock.','2000-09-09 17:08:07',26,'Yes'),(33,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','No','','2000-09-09 17:09:03',6,'Yes'),(35,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','Yes','','2000-09-09 17:11:29',28,'Yes'),(36,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','Yes','','2000-09-09 17:12:02',16,'Yes'),(37,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','Yes','','2000-09-09 17:14:17',29,'Yes'),(38,1,4,'Peter Petrakis','ppetrakis@alphalinux.org','N/A','Using 2.4.x kernel with kernel isa PnP and soundblaster driver compiled in.','2000-09-09 17:15:35',15,'Yes'),(39,8,8,'Christopher C. Chimelis','chris@debian.org','Yes','Uses the SYM53C8XX driver.','2000-09-09 17:22:21',30,'Yes'),(61,3,4,'Kurt Ludwig','kurt.ludwig@alpha-processor.com','Yes','This is one of the earlier rev cards (one that actually has the  DEC based chipset on it)','2000-09-11 08:54:36',32,'Yes'),(41,8,8,'Christopher C. Chimelis','chris@debian.org','Yes','Uses the tulip driver.  There are several revisions of this card, of which I have tested rev 20 and 21.','2000-09-09 17:26:46',32,'Yes'),(42,8,8,'Christopher C. Chimelis','chris@debian.org','Yes','An old card, but works fine with the S3 Xserver from 3.3.6 (untested with XF86 4.0.x).','2000-09-09 17:28:52',33,'Yes'),(43,50,9,'Sebastian Moeller','sebastian.moeller@lur.rwth-aachen.de','Yes','3Com 3c509B NIC works in Linux, woks not in SRM','2000-09-10 08:39:14',35,'Yes'),(44,7,1,'Iwao','makino@hpc.co.jp','N/A','Only tested SAN/LAN, no Myrinet 2000 test yet.\r\n\r\n','2000-09-10 21:04:14',36,'Yes'),(45,44,1,'Jim Barriault','jbarriau@endeavor.dwc.edu','Yes','','2000-09-11 01:19:22',34,'Yes'),(47,44,10,'Jim Barriault','jbarriau@endeavor.dwc.edu','Yes','Seen as comet by tru64.','2000-09-11 01:24:57',29,'Yes'),(48,3,10,'','','Yes','','2000-09-11 01:31:58',29,'Yes'),(49,24,12,'','','No','Seen by 