INSERT INTO `FrontPage` VALUES (1,'Security: RedHat Update to GPM','2000-09-23 18:31:06','gpm as shipped in Red Hat Linux 5.2 and 6.x contains a number of\r\nsecurity problems.  Additionally, a denial of service attack via\r\n/dev/gpmctl is possible.</I> Updates are available from <A HREF=\r\n\"ftp://ftp.alphalinux.org/mirrors/redhat/updates\">ftp.alphalinux.org</A> and other\r\n<A HREF=\"http://www.redhat.com/mirrors.html\">RedHat Mirrors</A>.',1,'News'),(2,'Security: Debian Update to dhcp-client-beta','2000-09-23 18:34:55','The OpenBSD team\r\n               reports that the client inappropriately executes commands embedded in replies sent from a dhcp server. This means that a malicious dhcp\r\n               server can execute commands on the client with root privilages</I>. Update\r\nare available for slink and potato from <A HREF=\"http://security.debian.org/dists \">\r\nsecurity.debian.org</A>.',1,'News'),(4,'Compaq TestDrive Update','2000-09-23 18:39:10','Want to try out AlphaLinux but don\'t yet have an Alpha?\r\n<P> Fear not, CSA\r\nTestdrive, Compaq\'s program to let you test out new technologies has many\r\npowerful AlphaServers running Linux just waiting for you to login. We have\r\nDS20s, Quad ES40s with four 500Mhz EV67 CPU\'s, XP5000s, DS10Ls.  All\r\nequipped with 2 to 4 gigabytes of memory, ultra fast SCSI drives, a huge\r\nraid array for all our user\'s home directories and more.  Our latest\r\naddition is the AlphaServer 466Mhz EV6 DS10L based BrickWall Beowulf\r\nCluster.  Featuring nine DS10Ls interconnected with a 100Mbs switch, each\r\nrunning Redhat 6.2 AlphaLinux.  Both PVM and LAM MPI are provided for\r\nparallel communication.  BrickWall serves as an example of building an entry\r\nlevel Beowulf cluster using the DS10L.  So come on over and take a testdrive\r\nof Alpha Linux on our new cluster or any of our other systems. All you have\r\nto do is register for your free account at <A HREF=http://testdrive.compaq.com>\r\ntestdrive.compaq.com</A>.',1,'News'),(5,'Security: RedHat Update to Netscape','2000-09-23 18:42:40','<I>New netscape packages are available that fix a potential \r\noverflow due to improper input verification in netscape\'s JPEG\r\nprocessing code.</I> Update are available from <A HREF=ftp://ftp.alphalinux.org/mirrors/redhat/updates>\r\nftp.alphalinux.org</A> and other <A HREF=http://www.redhat.com/mirrors.html>RedHat Mirrors</A>.\r\n<P>\r\n',1,'News'),(6,'AlphaLinux.org goes to Linux World','2000-09-23 18:42:43','AlphaLinux.org will be in San Jose next week for Linux World Conference\r\nand Expo. We\'ll be in booth number 136 in the .org pavillion.\r\nThere will be a couple demo\'s going on and we will be selling for the\r\nfirst time AlphaLinux T-shirts. Hope to see you all there. ',1,'News'),(7,'Security: RedHat Updates for umb-scheme, mailx and perl','2000-09-23 18:42:47','<I>New umb-scheme packages are available for Red Hat Linux 6.2 that fix a\r\nproblem with file permissions.Updated perl and mailx package are now available which fix a potential\r\nexploit made possible by incorrect assumptions made in suidperl.</I> Updates are available\r\nfrom all the <A HREF=http://www.redhat.com/mirrors.html>RedHat Mirrors</A>.',1,'News'),(8,'API and Cygnus Relase GnuPRO Toolkit for AlphaLinux','2000-09-23 18:42:50','API has announced the release on the GnuPRO toolkit for AlphaLinux. It\'s downloadable\r\nfrom either the <A HREF=http://www.alpha-processor.com/products/downloads/developer_support/Cygnus_gnuPRO_tools/>\r\nthe API website</A> or <A HREF=ftp://emperor.alpha-processor.com/pub/ftp.alpha-processor.com/developer_support/Cygnus_gnuPRO_tools/>\r\nthe API ftp server</A>.',1,'News'),(9,'\nNews From LWCE San Jose','2000-09-23 18:42:53','<A HREF=\"http://www.debian.org\">Debian</A> has release version 2.2 (Potato) as stable. Informix\r\nhas <A HREF=\"http://linuxtoday.com/news_story.php3?ltsn=2000-08-17-033-20-PR\">announced</A> the availibility\r\nof their commercial database on (SuSE) Linux. <A HREF=\"http://www.compaq.com\">Compaq</A> has placed the Alpha JumpStart Kit\r\ninto their own <A HREF=\"http://www.linuxalpha.compaq.com/sourceforge\">copy of sourceforge</A>. They have also\r\nmade this version of sourceforge available for download, and API, Scali and Dolphin have announced the\r\n   availability of WulfKit (tm) for Linux on Alpha. Dolphin produces a high speed set of interconnect cards, and\r\nScali produces a \"tuned\" MPI middleware. More info on this release is available from <A HREF=\"http://linuxpr.com/releases/2349.html\">\r\nthis Press Release</A>.',1,'News'),(11,'Netscape on AlphaLinux Part 1','2000-09-23 19:58:19','<P>         \r\n     Having a usable GUI browser for Alpha Linux is something us Alpha \r\nLinux users have wanted for a long time. The problem lies with the \r\nfact there are few GUI browsers for x86 Linux, let alone our beloved \r\nAlpha. Netscape Communicator makes up the largest GUI browser \r\nuser base. The problem here comes from the 64-bit unclean code that \r\nmakes up what we call Netscape Communicator. By now you are probably \r\nasking if Communicator is not 64-bit clean, how did they make it for \r\nTru64 UNIX? Well I\'ll tell you. They did it with this handy little \r\ncompile time flag part of Compaq\'s compilers called taso. The taso \r\nflag tells the linker to force the code into the lower 31-bit memory \r\naddress space. So what we have here is some questionable code, \r\ncompiled with our good friend taso, that now runs on Tru64 UNIX.\r\n<P>\r\n     Compaq has now released Netscape Communicator 4.7 for Alpha \r\nLinux. The download site may be found at \r\nhttp://www.compaq.com/partners/netscape/downloads/register_nav4_Linux-\r\n.html What you will find there is an RPM package containing both \r\nNetscape Communicator 4.7 and the Tru64 UNIX libraries required to run \r\nit on Alpha Linux. While you do have to register for the download, it \r\nwill cost you no money and only about a minute of your time to fill \r\nout the form. \r\n<P>\r\n     To install Netscape for RPM users simple use rpm with \"-i\" to \r\ninstall. For Debian users you will have to use alien to make a deb out \r\nof it. Alien with \"-dsk\" should produce the required deb, you will \r\nthen need to install it from root (\"/\") as the script is sort of brain \r\ndead. Once you have Netscape installed, you should be able to simple \r\ntype \"netscape\" from an xterm. The very first time you run Netscape \r\nfrom each user account it will give you a few error messages. These \r\nmessages are normal they simply are telling you that the directory \r\n\".netscape\" does not exist and there are no cache directories. Simply \r\nclicking on \"OK\" will let you continue on. Communicator will then \r\ncreate a directory \".netscape\" in your $home and a few configuration \r\nfiles within that directory. \r\n<P>\r\n     The first thing you will probably notice is the awesome speed at \r\nwhich Communicator functions. Compared to the Window$ equivalent it is \r\nquite fast. I would have to say the credit belongs to Compaq\'s \r\ncompiler development team. \r\n<P>\r\n     Java is about the only thing which does not work. Some small Java \r\napplets do run correctly, but others and especially large ones will \r\nlock the browser up. In cases like these you will need to use your \r\ngood friend kill with \"-9\" to take care of it. I highly recommend you \r\ndisable Java all together in edit -> preferences. \r\n<P>\r\n     After using Communicator for a couple of months, I like it. \r\nAlthough I really wish Java worked, but I guess having no Java is \r\nbetter then having no Communicator at all. Something I would like to \r\nyou to take note of is that Debian GNU/Linux 2.2 (potato) has added a \r\nclone of the taso flag. The trick now would be getting \r\nNetscape/AOL/whatever to compile Communicator for us. \r\n<P>\r\nRon Farrer\r\nrbf@farrer.net\r\nFeel free to send me comments, suggestions, corrections. Flames should \r\nbe directed at /dev/null.\r\n\r\n',1,'Articles'),(12,'Netscape on AlphaLinux Part 2\n','2000-09-23 20:00:38','<P>It has been a few weeks since I wrote the first Alpha Linux article. \r\nAfter getting some feedback I decided to do a followup article. First \r\nI would like to make a few corrections! I was informed by a Compaq C++ \r\ndeveloper that the taso flag used in Compaq\'s compilers actually does \r\nforce the code into a 32-bit pointer. Second I have heard from a few \r\npeople who claim that Java does work for them. However when I asked \r\nthem which distro and kernel version they use, none of them answered. \r\nThird I completely forgot to mention that you need a 2.1, 2.2, or 2.4 \r\nseries kernel to run Tru64 UNIX binaries. A 2.0 series will not work.\r\n\r\n<P>I have found a few things I do not like about Netscape. The most \r\nannoying thing is the cache. On my system it gobbled up as much disk \r\nspace as it could. What I found in $home/.netscape/cache/* was about \r\n464MB of cached files! Deleting them quickly gained back all my \r\nmissing disk space. \r\n\r\n<P>Running other Tru64 UNIX programs is also possible with the \r\nNetscape/libs package. The most noteworthy of these is probably Adobe \r\nAcroread. As I\'ve said before, not all Tru64 UNIX programs can be run. \r\nThe usual suspects include programs that use Tru64-style threads. \r\n\r\n<P>Thanks to several people I have gathered a little bit of information \r\non getting Alpha Linux to better support Tru64 UNIX binaries. If \r\nanyone is working on this I\'d like to hear about the progress. I have \r\nalso, again thanks to several people, gathered information on how to \r\nmake our taso flag more like the Tru64 UNIX version. If someone is \r\nworking on that, again, I\'d like to hear about the progress.\r\n\r\n<P>Thanks for your time!\r\n\r\n<P>Ron Farrer\r\n<BR>rbf@farrer.net\r\n',1,'Articles'),(13,'TotalView Debugger','2000-09-23 20:03:21','<CENTER><B>For Immediate Release</B></CENTER>\r\n<P>\r\nFebruary 16th, 2000\r\n<P>\r\n\r\n The TotalView windowing and command line debugger is now available for\r\n  Linux on both x86 (IA32) and Alpha hardware.\r\n<P>\r\n  TotalView is ideal for Beowulf clusters, as it supports \"single point\"\r\n  debugging of distributed, and/or threaded applications in Fortran (77\r\n  and 90), MPI (MPICH) and PVM, as well as C, C++ and machine code.\r\n<P>\r\n  TotalView is the debugger of choice for the DoE ASCI program, where it\r\n  runs on both \"Blue Mountain\" and \"Blue Pacific\" as well as Alpha\r\n  clusters. \r\n<P>\r\n  Full details and downloads of the software and documentation \r\n  from <A HREF=\"http://www.etnus.com\">http://www.etnus.com</A>\r\n\r\n  The site also includes instructions so that you can obtain your FREE\r\n  demo license.\r\n<P>\r\nOn Linux/Alpha we support both the GNU and Compaq compilers.\r\n\r\n',1,'Press'),(14,'Clustered CommuniGate Pro','2000-09-23 20:05:31','<P><B>\r\nStalker Announces Super-Symmetric Dynamic Cluster Version of CommuniGate Pro\r\n\r\n</B>\r\n<P>\r\n<UL>Key Features: \r\n              <LI>Cluster Support - Full Redundancy, Load Balancing</LI>\r\n              <LI>Multi-platform Support </LI>\r\n              <LI>Industry-strength, highly scalable </LI> \r\n              <LI>Administration via the Web</LI>\r\n              <LI>Extensive multi-domain support </LI>\r\n              <LI>Unique IMAP multi-mailbox features</LI> \r\n              <LI> HTTP access to E-mail, built-in Web Mailer</LI> \r\n              <LI> Extensive Anti-Spam techniques </LI>\r\n              <LI> Mailing Lists with Web Access and Interactive Archive Search</LI>\r\n              <LI> LDAP and ACAP Support</LI>\r\n              <LI> Personal Web Pages with automated publishing</LI>\r\n \r\n</UL>\r\n<P>\r\nMILL VALLEY, CA - February 1, 2000 - Stalker Software, Inc. today announced\r\nthe Super-Symmetric Dynamic Cluster version of CommuniGate Pro. The high-end\r\nCommuniGate Pro messaging system is available for Unix, Linux and NT platforms\r\nand can serve 200,000 accounts on single server installations and can now\r\nsupport several million accounts on heterogeneous multi-server Clusters.\r\n<P>\r\nIn 1999 over 4.5 million CommuniGate Pro accounts were licensed to small and\r\nmid-size ISPs migrating to the CommuniGate Pro platform to benefit from its\r\nunmatched stability and performance.\r\n<P>\r\nIn the same period of time, over 1500 CommuniGate Pro servers were installed\r\nat corporate, government, and educational sites that chose CommuniGate Pro for\r\nits standards-compliance and extremely rich feature set.\r\n<P>\r\nThe combined power and performance of CommuniGate Pro is now brought to the\r\ncarrier-grade level with the Dynamic Cluster release.\r\n\r\n<P>\r\nSuper-Symmetric Dynamic Clustering\r\n<P>\r\nCommuniGate Pro is the first product on the market providing true message\r\nclustering based on account-level synchronization. Before the CommuniGate Pro\r\nDynamic Cluster release, large ISPs had to use the solutions that relied\r\ncompletely on OS and FileSystem-level locking. Those solutions were advertised\r\nas scalable and reliable, but suffered from instability and performance drops\r\ninevitable for that type of design.\r\n<P>\r\nWhile Web Interface to E-mail became more and more popular, lock-based\r\nmessaging servers either failed to provide any Web Interface at all or\r\nprovided limited versions of non-native Web Interface at a cost of serious\r\nperformance degradation.\r\n<P>\r\nThe innovative account-level synchronization scheme used in CommuniGate Pro\r\nCluster is based on a TCP/IP protocol and provides non-locking multi-access to\r\nall mailboxes served by the Cluster.\r\n<P>\r\nReleased from file-locking duties, the same storage devices (file servers) can\r\nnow be used to handle much larger number of accounts than they could process\r\nwith older solutions, with increased stability and performance.\r\n<P>\r\nFrontend-Backend Topology\r\n<P>\r\nThe CommuniGate Pro Cluster can include a set of front-end servers taking the\r\nload off the back-end servers by performing all mail relaying operations,\r\nSSL encryption/decryption, and some other operations. Since only front-end\r\nservers are exposed to the Internet, they protect the back-end servers from\r\nall possible types of TCP/IP attacks (including DoS attacks).\r\n<P>\r\nFront-end servers have no access to the account information and protect the\r\nsite from any type of server OS exploits.\r\n<P>\r\nFrontend Load Balancing and Redundancy\r\n<P>\r\nWhile the frontend servers are at a higher risk of failure, the site survives\r\ntill at least one front-end server is in operation. Front-end servers can be\r\nadded and removed from the cluster at any moment, with no switch-off/recovery\r\noperations required.\r\n<P>\r\nThe load can be balanced between frontend servers using traditional traffic-\r\nbased method (as Layer4 Switches) or using DNS round-robin mechanisms.\r\n<P>\r\nBack-end Load Balancing and Redundancy\r\n<P>\r\nSophisticated mail servers can experience heavy load without producing a lot\r\nof traffic (for example, there can be many search operations in progress). To\r\nprovide the best site performance, front-end servers distribute operations\r\nbetween back-end servers based on the real load, not on the traffic volume.\r\n<P>\r\nAll back-end servers provide access to the same domains and accounts, and any\r\nback-end server can be switched off at any time and a back-end server can be\r\nadded to the Cluster at any time, too - without stopping the site.\r\n<P>\r\nThe CommuniGate Pro Dynamic Cluster synchronization protocol provides the\r\nauto-cleanup methods, so if a back-end server fails, there is not need to\r\nmanually clean any resources it could lock at the time of the failure.\r\n<P>\r\nTransparency\r\n<P>\r\nCommuniGate Pro is well known for its clean and clear WebAdmin interface for\r\nboth server and domain (delegated) administration. The CommuniGate Pro Cluster\r\nis completely transparent for both users and administrators, and presents\r\nexactly the same interfaces as it does on single-server sites. Administration\r\ncommands are automatically directed to the proper server and updates are\r\nautomatically propagated to all servers in the Cluster.\r\n<P>\r\n\r\nTry Before You Buy\r\n<P>\r\nThe CommuniGate Pro Free Trial Version is available at\r\n    <A HREF=\"http://www.stalker.com/CommuniGatePro/\">http://www.stalker.com/CommuniGatePro</A>.<BR>\r\nSee <A HREF=\"http://www.stalker.com/CommuniGatePro/Licensing.html\">http://www.stalker.com/CommuniGatePro/Licensing.htm</A> for the details.\r\n<P>\r\nThe updated versions (both betas and finals) are posted on a regular basis.\r\n<P>\r\nDiscuss the Communigate Pro-related issues at\r\n    <A HREF=\"http://mail.stalker.com/Lists/CGatePro.html\">http://mail.stalker.com/Lists/CGatePro.htm</A>.\r\n<P>\r\nThe Dynamic Cluster support requires the Site and Cluster License Keys.\r\nContact Stalker at 800-262-4722 or <A HREF=\"mailto:sales@stalker.com\">sales@stalker.com</A> to learn more about\r\nthe licensing policies.\r\n<P>\r\n\r\n                                         ###\r\nStalker Software, Inc. develops and distributes mail servers, networking and\r\ncommunication software. The company was founded in Europe in 1991 and opened\r\nits U.S. offices in 1993 at 655 Redwood Highway, Suite 275, Mill Valley,\r\nCalif. 94941. For more information about Stalker Software, Inc. and its\r\nproducts, please contact Alice Liptrot, director of sales and marketing,\r\nat (800) 262-4722 or (415) 383-7164. She can also be contacted by fax\r\nat (415) 383-7461 or E-mail at <A HREF=\"mailto:ali@stalker.com\">ali@stalker.com</A>.\r\nVisit the Stalker Software web site at <A HREF=\"http://www.stalker.com\">http://www.stalker.com</A>. ',1,'Press'),(17,'New 64-bit Unix Mailing List','2000-09-28 16:50:20','From <A HREF=\"http://www.advogato.com\">Advogato</A>:\r\n<P>I\'ve made a new mailing list for discussion of all 64 bit Unix issues, irrespective of processor, Unix varient. All are welcome. I\'d like to see commerical\r\n 64 bit Unix users as well as open source ones all join in. \r\n<P>\r\n The ix64 mailing list \r\n<BR>\r\n     For discussion of issues relating to 64 bit Unix and Unix style OS\'s and applications that run under them. The list is CPU, endian and Unix varient\r\n     agnostic; discussions about issues on particular CPUs/Unixs should be restricted to comparison between systems, attempting to see if issues are\r\n     truly 64 bit issues, and generalized issues.\r\n<P>\r\n     Please keep it nice and friendly - flame wars should be extinguished as soon as possible!!! \r\n<P>\r\n     I guess many of us Alpha users find bugs in apps which mean they aren\'t 64 bit clean; we fix them and I suspect they eventualyl get back to the\r\n     authors. But I bet you MIPS, SPARC, PowerPC etc guys have the same problems; and when a new app comes out I guess we all fight it at the same\r\n     time - what a waste! \r\n<P>\r\n     Also, I guess there are \'how should we change this\' for 64 bit questions which would be nice to keep consistent. \r\n<BR>     See: <A HREF=\"http://lists.treblig.org/mailman/listinfo/ix64 \">http://lists.treblig.org/mailman/listinfo/ix64</A>\r\n<P>\r\n     (If you have problems resolving lists.treblig.org please email me at dave@treblig.org - It seems to have stabilised but I\'d like to know of problems). \r\n',1,'News'),(18,'EV6 Kernel Performance Patch','2000-10-17 19:06:44','API has updated the kernel\'s assembly routines for EV6. The patch is available\r\nfrom <A HREF=\"http://www.alpha-processor.com/products/downloads/developer_support/performance/\">\r\nwww.alpha-processor.com</A>. \r\n<P>\r\n<I>Performance summary: <BR>Using these patches results in a _system_ time speedup\r\nof\r\n        40% when doing kernel builds, and 15% to 20% when doing gcc builds.\r\n</I>\r\n<P><B>[ UPDATE ]</B> The URL has changed and API has added new versions\r\nfor 2.2.17 and 2.4.0-test9.',1,'News'),(19,'*Quick Binaries for Alpha','2000-10-14 18:21:11','*Quick is a translation system for words, acronyms, postal codes, ...\r\nKQuick 0.9 is out, and you can get it (including the RPM for AXP) from\r\n<A HREF=\"http://www.futureware.at/kquick.htm\">http://www.futureware.at/kquick.htm</A>.\r\nI am interested whether there is any interest in it, so that I will continue to produce AXP versions.\r\nSo please send me an Email or a postcard, if you would like to see AXP versions.\r\n',1,'News'),(20,'Jensen Installation Howto Updated','2000-10-23 17:36:28','Updated for use with aboot-0.7 , updated procedure, kernel , and patches.\r\nAvailable at <A HREF=\"http://www.alphalinux.org/docs/jensen-install-0.7.shtml\">http://www.alphalinux.org/docs/jensen-install-0.7.shtml</A> .',1,'News'),(21,'Security: RedHat update to ypbind and curl','2000-10-25 09:41:28','<I>ypbind as shipped in Red Hat Linux 5.x and 6.x is vulnerable to a local\r\nroot exploit.  A bug in some versions of curl would cause it to incorrectly parse error\r\nresponses from FTP servers.</I> Updates are available from <A HREF=\"ftp://ftp.alphalinux.org/mirrors/redhat/updates/\">\r\nftp.alphalinux.org </A>and RedHat <A HREF=\"http://www.redhat.com/mirrors.html\">mirrors</A>.',1,'News'),(22,'Software: New JDK For AlphaLinux','2000-10-27 09:27:51','According to <A HREF=\"https://www.linuxalpha.compaq.com/sourceforge/project/?group_id=7\">\r\nthis page</A> on the Compaq SourceForge site a public beta of JDK1.2.2 for\r\nAlphaLinux is to be released on October 31st.',1,'News'),(23,'ALO SetiAtHome Group','2000-10-27 09:28:41','If anybody\'s interested we\'ve setup the AlphaLinux Org Setiathome group. You can\r\njoin by <A HREF=\"http://setiathome.ssl.berkeley.edu/unix.html\">downloading the\r\nUnix client</A>, then joining via the <A HREF=\"http://setiathome.ssl.berkeley.edu/stats/team/team_92419.html\">\r\ngroup page</A>. Please note the name of the group is The AlphaLinux Organization (\r\nnot just alphalinux or ALO).',1,'News'),(24,'Documentation: Updated Alpha-FAQ Released','2000-11-03 13:40:11','After many months of inactivity the Alpha FAQ has now been updated. This has\r\nbeen a fairly major update but I\'m sure there\'s still more to do. As always it\'s\r\navailable in <A HREF=\"http://www.alphalinux.org/faq/FAQ.html\"> HTML</A>\r\nand <A HREF=\"http://www.alphalinux.org/faq/otherformats\">other formats</A>.',1,'News'),(26,'New SRM-Howto Released','2000-11-10 15:59:52','We\'ve released a new version of the <A HREF=\"http://www.alphalinux.org/faq/srm.html\">SRM-HOWTO</A>. Updates\r\ninclude a new section on SRM device naming, more detailed information on netbooting,\r\nas well as many corrections and minor updates.',1,'News'),(27,'Security: RedHat Updates to Pine and Imap','2000-11-10 17:35:27','<A HREF=\"http://www.redhat.com\">RedHat</A> has issued updates to Pine\r\nand Imap for all version from 5.2 through 7.0. The details are as follows:\r\n<P><I>By adding specific headers to messages, the pine mail reader and the imap\r\nserver could be made to exit with an error message when users attempted to\r\nmanipulate mail folders containing those messages.\r\n<P>\r\nThis release also introduces SSL support to Red Hat Linux 6.x, Kerberos\r\nsupport for Red Hat Linux 6.0 and 6.1, and LDAP support for Red Hat Linux\r\n6.0.  This means that the packages from the enhancement advisories for\r\nthese packages will also need to be installed.</I>\r\n<P>Updates are available from <A HREF=\"ftp://ftp.alphalinux.org/mirrors/redhat/updates/\">ftp.alphalinux.org</A>\r\nand <A HREF=\"http://www.redhat.com/mirrors.html\">RedHat mirrors</A>.',1,'News'),(28,'Software: Announcing AlphaHelix','2000-11-12 12:45:39','We\'ve taken the current RedHat-6 code base from the folks at Helix and recompiled\r\nthem for Alpha (EV5). The binaries are available from <A HREF=\"ftp://ftp.alphalinux.org/pub/gnome/helix-gnome/distributions\">\r\nftp.alphalinux.org</A> and should soon be available from <A HREF=\"http://www.alphalinux.org/mirrors/\">\r\nALO Mirrors</A>. The source is available in the SRPMS directory (a few packages have\r\nbeen slightly modified). Make sure to read the README file before downloading\r\nand installing. Enjoy :)',1,'News'),(29,'Search All Of AlphaLinux.Org','2000-11-12 14:08:16','Ever wanted to search the entire AlphaLinux.Org website? Now you can. Just use\r\nour <A HREF=\"http://www.alphalinux.org/search.shtml\">search</A> page and from there you can search the\r\nentire site (thanks to <A HREF=\"http://www.google.com\">Google</A>).',1,'News'),(30,'Security: RedHat and Debian Update to Bind','2000-11-13 12:59:23','<I>A remote DoS (denial of service) attack is possible with bind versions\r\nprior to 8.2.2_P7.</I> RedHat updates are available from <A HREF=\"ftp://ftp.alphalinux.org/mirrors/\">\r\nftp.alphalinux.org</A> or <A HREF=\"http://www.redhat.com/mirrors.html\">RedHat Mirrors</A>.\r\nDebian users can update from <A HREF=\" http://security.debian.org/dists/potato/updates/main/binary-alpha\">\r\nsecurity.debian.org</A>.',1,'News'),(31,'Documentation: New MILO-Howto Released','2000-11-14 17:29:46','After several years of not being updated we\'ve made some minor updates to\r\nthe <A HREF=\"http://www.alphalinux.org/faq/milo.html\">MILO-Howto</A>. As\r\nalways it\'s available from <A HREF=\"http://www.alphalinux.org\">AlphaLinux.Org</A>\r\nand well as <A HREF=\"http://www.linuxdoc.org\">The Linux Documentation Project</A>.',1,'News'),(33,'Linux.com Article on Hardware - Alpha','2000-11-20 11:00:18','In <A HREF=\"http://linux.com/hardware/article_archive.phtml?maxarticles=12\">\r\npart III </A>(of V) Ross Sanders takes a look at Alpha in his quest to build his\r\nLinux dream machine. <P><I>\r\n Let\'s briefly outline my requirements for the system I want. To make it into my shopping cart, it\'s gotta have at\r\n                      least 3 open PCI slots, AGP support, RS-232 support, a proven performance record, and good support under\r\n                      Linux. I demand a slot open for the CCD camera, RS-232 for the telescope stepping motors, and a decent 3D\r\n                      card for rendering images. Next, the computations this computer must handle will be floating point intensive (in\r\n                      some cases double precision). That\'s why I require a proven track record of speed and power in dealing with\r\n                      such calculations. </I>',1,'News'),(34,'Netscape 4.76 and GhostScript Security Update','2000-11-23 12:47:43','The RPM-package for Netscape 4.76 is available at <A HREF=\"ftp://ftp.redhat.com\">\r\nftp.redhat.com</A>and <A HREF=\"http://www.redhat.com/mirrors.html\">mirrors</A>.\r\nAlso made available is a security update to GhostScript for RedHat verions 5.0 to 7.0\r\nfor a temp file fix.',1,'News'),(35,'Debian Security Updates','2000-11-23 12:51:43','<A HREF=\"http://www.debian.org\">Debian</A> has released security updates for\r\nthe following packages: elvis-tiny, modutils, xmcd and ncurses. Updates are available\r\nfrom <A HREF=\" http://security.debian.org/dists/potato/updates/main/binary-alpha/\">\r\nsecurity.debian.org</A>.',1,'News'),(36,'RedHat Releases 7.0 for Alpha','2000-11-27 16:50:08','<A HREF=\"http://www.redhat.com\">RedHat</A> have released version 7.0\r\nfor Alpha. There\'s more information in <A HREF=\"http://biz.yahoo.com/bw/001127/nc_red_hat.html\">\r\nthe press release</A>. As usual I\'m sure it\'ll take the mirrors a day or two to catch\r\nup. We\'ll get a copy up to ftp.alphalinux.org as soon as possible.',1,'News'),(37,'Secuirity: RedHat Updates to Bash (and others)','2000-11-28 11:50:12','<A HREF=\"http://www.redhat.com\">RedHat</A> has released a new version of\r\nBash for RedHat 5.0 to 6.2EE due to <I>\"The << operator in bash 1.x used predictable filenames, \r\nleading to a potential denial of service attack.\"</I> Also for people installing the new\r\nRedHat 7.0 remember to download the updates as well, there\'s several security problems\r\nin there that have already been fixed.',1,'News'),(38,'SuSE Release Version 7.0 for Alpha','2000-11-28 21:39:17','<A HREF=\"http://www.suse.com\">SuSE</A> have now released SuSE Version 7.0\r\nfor Alpha. Features include: <I>\"The installation/configuration tool YaST  provides the user with the whole\r\nrange of configuration and administration functions. ATI and Matrox chipsets\r\nnow benefit from the improved performance of XFree86 4.01. The configuration\r\ntool SaX2 ensures the easy installation and setup of graphics cards. Users\r\nnow have all boot loaders for Alpha-Linux at their disposal - Milo 2.2, APB\r\nand Aboot 0.7a. The compilers for Compaq C, C++, Fortran and the respective\r\nmath libraries are also new in this package.\"</I>',1,'News'),(39,'Mathematica 4.1','2000-12-04 20:12:18','<B>Mathematica 4.1 Adds Features and Platforms and Increases Performance</B>\r\n\r\n<P>November 27, 2000--Champaign, IL--Wolfram Research, Inc. is\r\nproud to announce the release of Mathematica 4.1, the latest\r\nversion of the world\'s leading technical computing system.\r\n<UL>Key new features in Mathematica 4.1 include:\r\n<LI>*Enhanced symbolic differential equation solvers\r\n<LI>*Dramatic speed improvements in statistics functions\r\n<LI>*Java integration with J/Link 1.1\r\n<LI>*Improved MathML integration including copy and paste of\r\nformulas to web browsers\r\n<LI>*New support for LinuxPPC and AlphaLinux platforms\r\n<LI>*New and faster import/export filters for Excel files, tabular\r\ndata, compressed BMP, DXF, and others\r\n</UL>\r\n<P>\r\nMathematica 4.1 also incorporates the newest results from\r\nWolfram Research\'s ongoing research and development effort. This\r\neffort has been focused on finding new ways to help technical\r\nprofessionals solve two of their primary challenges: handling\r\never-larger data sets and increasingly complex calculations, and\r\ncommunicating technical content faster and more efficiently over\r\nthe Internet.\r\n<P>\r\nAnother exciting new development is expanded support for Linux\r\nplatforms. \"Linux has become one of the prime operating systems\r\nfor researchers and students. Mathematica now supports all major\r\nLinux platforms natively, making it the only technical\r\nsoftware--and one of few software packages overall--to do so.\r\nWith Mathematica 4.1 and Parallel Computing Toolkit, the Linux\r\nclusters popular in both academic and commercial settings can\r\neasily solve large-scale problems. There are currently more than\r\n150 users of this powerful combination, including the Cornell\r\nTheory Center, other leading universities, and several national\r\nlaboratories,\" says Lars Hohmuth, Manager of Strategic Marketing\r\nat Wolfram Research. In addition, AlphaLinux is currently the fastest platform running Mathematica.\r\n<P>\r\nMathematica now works better for large academic and corporate\r\nnetworks. Transparent network licensing simplifies system\r\nadministration, and expanded import and export features allow\r\nMathematica to integrate more smoothly with other software.\r\n<P>\r\nThe suggested retail price for Mathematica 4.1 is $1495 in the\r\nUS and Canada for commercial licenses and includes Stephen\r\nWolfram\'s The Mathematica Book, Fourth Edition. Existing\r\nMathematica Premier Service subscribers will have their\r\nVersion 4.1 upgrade automatically shipped to them--one of the\r\nmany benefits of the Premier Service program. Mathematica,\r\nPremier Service, and other Wolfram Research products may be\r\npurchased online at the Wolfram Research web site or from\r\nauthorized Mathematica resellers. Upgrade, academic, network,\r\nand volume purchase discounts are available, and a student\r\nedition of Mathematica 4.1 will be released in early 2001. More\r\nproduct details are available at\r\n<A HREF=\"http://www.wolfram.com/products/mathematica/newin41\">www.wolfram.com/products/mathematica/newin41</A>.\r\n\r\n<P>Wolfram Research is the world\'s leading developer of technical\r\ncomputing software. The company was founded in 1987 by Stephen\r\nWolfram and released the first version of Mathematica, its\r\nflagship product, on June 23, 1988. Mathematica, the world\'s\r\nonly fully integrated technical computing system, is relied on\r\ntoday by more than a million users worldwide in industry,\r\ngovernment, and education, and is the recipient of many industry\r\nawards for technical excellence. Wolfram Research, a privately\r\nheld company, is headquartered in Champaign, Illinois, with\r\noffices in Europe and Japan. More information about Wolfram\r\nResearch and its products is available at\r\n<A HREF=\"http://www.wolfram.com\">www.wolfram.com</A>.\r\n\r\n',1,'Press'),(40,'Linux.com Article - Ross Picks the Alpha','2000-12-04 20:19:11','In <A HREF=\"http://www.linux.com/hardware/newsitem.phtml?sid=1&aid=11362\">\r\nPart V of V</A> in his article on alternatives to x86 machines Ross makes his\r\nchoice and goes for the Alpha. Good choice!',1,'News'),(41,'Mathematica 4.1 for AlphaLinux','2000-12-08 19:58:48','<P>November 27, 2000--Champaign, IL--Wolfram Research, Inc. is\r\nproud to announce the release of Mathematica 4.1, the latest\r\nversion of the world\'s leading technical computing system.\r\n<UL>Key new features in Mathematica 4.1 include:\r\n<LI>*Enhanced symbolic differential equation solvers\r\n<LI>*Dramatic speed improvements in statistics functions\r\n<LI>*Java integration with J/Link 1.1\r\n<LI>*Improved MathML integration including copy and paste of\r\nformulas to web browsers\r\n<LI>*New support for LinuxPPC and AlphaLinux platforms\r\n<LI>*New and faster import/export filters for Excel files, tabular\r\ndata, compressed BMP, DXF, and others\r\n</UL>\r\n\r\nFrom the <A HREF=\"http://talisman.alphalinux.org/press-articles/index.php?indx=39&type=Press\">\r\nNovember 27th </A> press release.\r\n',1,'News'),(42,'Debian GNU/Linux 2.2r2 Released','2000-12-06 13:36:46','\r\n<pre>\r\nTo: debian-announce@lists.debian.org\r\nSubject: Debian GNU/Linux 2.2r2 Released\r\nFrom: \"Nils Lohner\" &lt;lohner@debian.org&gt;\r\nDate: Tue, 05 Dec 2000 14:45:37 +0100\r\n\r\n\r\n------------------------------------------------------------------------\r\nDebian Project                                    <a href=\"http://www.debian.org/\">http://www.debian.org/</a>\r\nDebian GNU/Linux 2.2r2 Released                         press@debian.org\r\nDecember 5, 2000\r\n------------------------------------------------------------------------\r\n\r\n<font color=#990099>&gt;&gt; News</font>\r\n\r\nA new revision of the Debian GNU/Linux 2.2 \'potato\' distribution has been \r\nreleased. This update, version 2.2r2, includes both security updates and \r\nfixes to important bugs in the stable distribution.\r\n\r\nUpgrading to this revision online can be done pointing the \'apt\' package \r\ntool (see sources.list(5) manpage) to one of Debian\'s many FTP mirrors.  A \r\nlist is available at:\r\n  &lt;<a href=\"http://www.debian.org/distrib/ftplist\">http://www.debian.org/distrib/ftplist</a>&gt;\r\n\r\nA complete list of the packages that have changed with this \r\nrelease can be found at:\r\n  &lt;<a href=\"http://http.us.debian.org/debian/dists/Debian2.2r2/ChangeLog\">http://http.us.debian.org/debian/dists/Debian2.2r2/ChangeLog</a>&gt;\r\n  &lt;<a href=\"http://non-us.debian.org/debian-non-us/dists/Debian2.2r2/non-US/ChangeLog\">http://non-us.debian.org/debian-non-us/dists/Debian2.2r2/non-US/ChangeLog</a>&gt;\r\n\r\nFiles that are included in the update as well as the entire stable and \r\nunstable distributions can be found in the locations listed below.  Updates \r\nthat have been accepted into the stable distribution are merged into the \r\nstable tree.\r\n\r\n\r\n<font color=#990099>&gt;&gt; URLs</font>\r\n\r\nThe current stable distribution:\r\n  &lt;<a href=\"ftp://ftp.debian.org/debian/dists/stable\">ftp://ftp.debian.org/debian/dists/stable</a>&gt;\r\n  &lt;<a href=\"ftp://non-us.debian.org/debian-non-US/dists/stable\">ftp://non-us.debian.org/debian-non-US/dists/stable</a>&gt;\r\n\r\nProposed updates to the stable distribution:\r\n  &lt;<a href=\"ftp://ftp.debian.org/debian/dists/proposed-updates\">ftp://ftp.debian.org/debian/dists/proposed-updates</a>&gt;\r\n  &lt;<a href=\"ftp://non-us.debian.org/debian-non-US/dists/proposed-updates\">ftp://non-us.debian.org/debian-non-US/dists/proposed-updates</a>&gt;\r\n\r\nStable distribution information (release notes, errata, etc.):\r\n  &lt;<a href=\"http://www.debian.org/releases/stable/\">http://www.debian.org/releases/stable/</a>&gt;\r\n\r\nSecurity announcements and information:\r\n  &lt;<a href=\"http://security.debian.org/\">http://security.debian.org/</a>&gt;\r\n\r\n\r\n<font color=#990099>&gt;&gt; About Debian</font>\r\n\r\nThe Debian project is an organization of many users who volunteer \r\ntheir time and effort.  Its tasks include maintaining and updating Debian \r\nGNU/Linux which is a free distribution of the GNU/Linux operating system, \r\nand the development of the Debian GNU/Hurd operating system.\r\n\r\n\r\n<font color=#990099>&gt;&gt; Contact Information </font>\r\n\r\nFor further information, please send email to the Debian Press Team \r\n&lt;press@debian.org&gt; or visit the Debian homepage at &lt;<a href=\"http://www.debian.org/\">http://www.debian.org/</a>&gt;.\r\nAnthony Towns &lt;ajt@debian.org&gt; is the release manager for the Debian Project.\r\n\r\n\r\n-- \r\nNils Lohner                             E-Mail: lohner@debian.org\r\nDebian Press Team                       Press:  press@debian.org\r\n\r\n\r\n\r\n--  \r\nTo UNSUBSCRIBE, email to debian-announce-request@lists.debian.org\r\nwith a subject of \"unsubscribe\". Trouble? Contact listmaster@lists.debian.org\r\n\r\n</pre>',1,'Press'),(43,'Debian Releases 2.2r2','2000-12-06 13:37:46','<I>A new revision of the Debian GNU/Linux 2.2 \'potato\' distribution has been \r\nreleased. This update, version 2.2r2, includes both security updates and \r\nfixes to important bugs in the stable distribution.</I>  More information is available\r\nfrom <A HREF=\"http://talisman.alphalinux.org/press-articles/index.php?indx=42&type=Press\">\r\nthe official</A> press release.',1,'News'),(44,'JDK 1.2.2 Made Available','2000-12-14 13:24:41','<A HREF=\"http://www.compaq.com\">Compaq</A> has made available beta004\r\nof their JDK for AlphaLinux. It can be downloaded from the\r\n<A HREF=\"http://www.linuxalpha.compaq.com/java122/download.html\">linuxalpha.compaq.com</A>\r\nwesbite.',1,'News'),(45,'RedHat Issues Updated GCC and Zope, Debian Updates Zope','2000-12-20 22:52:44','<A HREF=\"http://www.redhat.com\">RedHat</A> has released an updated version\r\nof the GCC snapshot (2.96) for RedHat 7.0. The list of updates are availabe\r\nfrom <A HREF=\"https://listman.redhat.com/pipermail/redhat-watch-list/2000-December/000228.html\">\r\nthis posting</A> from the redhat-watch-list. Both <A HREF=\"http://www.redhat.com\">\r\nRedHat</A> and <A HREF=\"http://www.debian.org\">Debian</A> has released update\r\nto Zope due to the recent insufficient protection problem found. RedHat updates are\r\navailable from <A HREF=\"ftp://ftp.redhat.com\">ftp.redhat.com</A> and Debian updates\r\nare available from <A HREF= http://security.debian.org/dists/stable/updates\">security.debian.org</A>.\r\n',1,'News'),(46,'IDL® Release 5.4 for AlphaLinux','2000-12-20 22:56:48','<I>\r\n                  Research Systems, Inc. Announces Worldwide Release of IDL® 5.4 \r\n<P>\r\n                  BOULDER, Colo., October 18, 2000 - Research Systems, Inc., a leading global developer of technical visualization and\r\n     <P>             application development software, announces the worldwide release of version 5.4 of IDL, the Interactive Data Language. \r\n\r\n                  IDL is software for data analysis, visualization, and cross-platform application development. IDL includes all the tools\r\n                  needed for quick-look, interactive analysis, display and large-scale commercial programming projects, in a fully extensible\r\n                  environment. \r\n<P>                  Versions of IDL 5.4 are available for Microsoft Windows® 95/98/NT/2000, Macintosh®, and UNIX® platforms, including\r\n                  support for Red Hat Linux on the Compaq Alpha platform, which is new to this version.</I>\r\n\r\n<P><A HREF=\"http://www.rsinc.com/pr/detail.cfm?PressReleaseID=9\"> Complete Press Release</A>.\r\n',1,'Press'),(49,'Security: RedHat update to glibc','2001-01-16 21:37:28','<I>A bug in GNU C Library allows unprivileged user to preload libraries\r\nlocated in /lib or /usr/lib directories into SUID programs even if those\r\nlibraries have not been marked as such by system administrator.</I>\r\nThe problem effects all RedHat 6.x versions. Updates are available from <A HREF=\"ftp://ftp.alphalinux.org\">ftp.alphalinux.org</A>\r\nand <A HREF=\"http://www.redhat.com/mirrors.html\">RedHat Mirrors</A>.',1,'News'),(50,'Slackware Linux available for Alphas','2001-01-23 11:44:11','The Alpha port of Slackware Linux was uploaded to ftp.slackware.com \r\ntoday.  This is the -current tree, meaning that it is the tree where \r\nactive development takes place.  Users should check the ChangeLog.txt \r\nfile in the main directory for the most recent changes.\r\n<P>\r\nSlackware for the Alpha can be downloaded from:\r\n\r\n	<A HREF=\"ftp://ftp.slackware.com/pub/slackware/alpha\">	\r\n	ftp://ftp.slackware.com/pub/slackware/alpha</A>\r\n<P>\r\nOur website contains some information as well:\r\n\r\n	<A HREF=\"http://www.slackware.com\">http://www.slackware.com</A>\r\n<P>\r\n- Chris Lumens \r\n  chris@slackware.com',1,'News'),(52,'Security: Debian update to MySQL','2001-01-23 11:42:22','<I>Nicolas Gregoire has reported a buffer overflow in the mysql server\r\nthat leads to a remote exploit.  An attacker could gain mysqld\r\nprivileges (and thus gaining access to all the databases).</I> Updates\r\nare available from <A HREF=\"   http://security.debian.org/dists/stable/updates/main/binary-alpha/\">\r\n   http://security.debian.org/dists/stable/updates/main/binary-alpha/</A>',1,'News'),(53,'Software: AlphaXimian Available For RedHat 7.0','2001-01-25 19:42:15','We\'ve taken the current <A HREF=\"http://ximian.com\">Ximian (was \r\nHelixCode)</A> Gnome desktop and recompiled it for RedHat 7.0. The RPMs are available\r\nfrom <A HREF=\"ftp://ftp.alphalinux.org/pub/gnome/helix-gnome/\">\r\nftp.alphalinux.org</A>, don\'t forget to use your closest <A HREF=\"http://www.alphalinux.org/mirrors/\">\r\nmirror</A>.',1,'News'),(54,'Security: RedHat and Debian update to Bind','2001-01-30 16:56:33','<I>BIND 8 suffered from several buffer overflows.  It is possible to\r\nconstruct an inverse query that allows the stack to be read remotely\r\nexposing environment variables.  CERT has disclosed information about\r\nthese issues.</I> Anybody running BIND is recommended to update\r\nimmediatly. RedHat updates are available from <A HREF=\" ftp://updates.redhat.com\">\r\nupdates.redhat.com</A> and <A HREF=\"http://www.redhat.com/mirrors.html\">\r\nRedHat Mirrors</A>. Debian updates are available from <A HREF=\"  http://security.debian.org/dists/stable/updates/main/binary-alpha\">\r\nsecurity.debian.org</A>.',1,'News'),(55,'New Cray SuperComputer Based on API CS20','2001-01-30 11:20:26','<I>Global supercomputer leader Cray Inc. (Nasdaq:CRAY) today announced plans to offer Alpha Linux SuperCluster(R) systems -- large-scale clusters that combine blazing\r\nproblem-solving speed with increasingly powerful technical data center features, attractive price-performance and the popular Linux operating system.</I>\r\n<P>\r\nFrom <A HREF=\"http://www.businesswire.com/cgi-bin/f_headline.cgi?bw.012901/210290281&ticker=CRAY\">\r\nthis Cray press release</A>, see also <A HREF=\"http://www.alpha-processor.com/pressreleases/pr012901.shtml\">\r\nthis release</A> on API NetWorks\' website.',1,'News'),(56,'Security: SuSE Update to Glibc','2001-01-30 16:52:54','Due to a local root compromise in the version of Glibc shipped\r\nwith all SuSE versions users are recommended to upgrade to the\r\nnewest version. Updates are available from <A HREF=\"  ftp://ftp.suse.com/pub/suse/axp/update\">\r\nftp.suse.com</A>.',1,'News'),(58,'Optimized BLAS/Lapack Routine','2001-02-10 19:40:18',' <P>This is an announcement of an Optimized BLAS/Lapack routines for Alpha EV5\r\nand EV6.\r\n\r\nYou can download it from\r\n<BR><A HREF=\"ftp://www.netstat.ne.jp/pub/Linux/Linux-Alpha-JP/BLAS/\">\r\nftp://www.netstat.ne.jp/pub/Linux/Linux-Alpha-JP/BLAS/</A>\r\n\r\n<P>Features:<BR>\r\n  This is an optimized BLAS(Level 1, 3 and some 2) and some lapack(GESV,\r\nLASWP, GETF2, GETRF) library for Alpha.  And Level 3 routines and\r\nsome lapack(GETRF, LASWP) routines are parallelized  by posix thread.\r\nYou can choose SINGLE/SMP version by editing the File \"Makefile.rule\".\r\n<P>\r\nSupport OS:\r\n  Linux/Alpha and Tru64 UNIX(it works fine on V4.0F and 5.1, need GNU\r\nmake).\r\n<P>\r\nThanks,\r\n  goto@statabo.rim.or.jp\r\n',1,'News'),(61,'OSDN Adds Compaq AlphaServer','2001-02-16 12:24:08','<I> Feb 15th, 23:47 UTC \r\n<P>\r\n   SourceForge.net Service Enables Building and Testing of Open Source\r\n   Applications for Linux on Alpha and Tru64 UNIX\r\n<P>\r\n   ACTON, Mass. -- Feb. 15, 2001 -- The Open Source Development Network\r\n   (OSDN.com), a division of VA Linux Systems, Inc. (Nasdaq:LNUX) today\r\n   announced the availability of Compaq\'s AlphaServer(TM) platforms, with the\r\n   Tru64(TM) UNIX® and Linux operating systems, on the SourceForge.net(TM)\r\n   CompileFarm (http://www.sourceforge.net/compilefarm/).</I>\r\n<P>From: <A HREF=\"http://linuxpr.com/releases/3335.html\">http://linuxpr.com/releases/3335.html</A>',1,'News'),(60,'JDK 1.3.1 (beta) released by Compaq for AlphaLinux','2001-02-16 12:07:31','Get it at <A HREF=\"http://www.compaq.com/java/download/jdk_linux/1.3.1/index.html\">\r\nwww.compaq.com/java/download/jdk_linux/1.3.1/index.html</A>. Together with\r\nForte from Sun (get the \"All Platforms\" download for a pure java installer), we now have\r\na complete IDE for AlphaLinux.\r\n\r\n',1,'News'),(62,'Security: SuSE Update to SSH','2001-02-17 11:56:44','<I> SuSE distributions contain the ssh package in the version 1.2.27. No\r\n    later version is provided because of licensing issues. SuSE maintains\r\n    the 1.2.27 version in a patched package. Three new patches have been added\r\n    that workaround three independent security problems in the ssh package</I>\r\nMore information is available in the <A HREF=\"http://lwn.net/daily/suse-ssh.php3\">\r\noriginal SuSE message</A> and updates can be downloaded from <A HREF=\"\r\n  ftp://ftp.suse.de/pub/suse/axp/update\">  ftp://ftp.suse.de/pub/suse/axp/update</A>.',1,'News'),(66,'Security: RedHat Update to Zope','2001-02-27 11:09:06','<I>New Zope packages are available which fix numerous security vulnerabilities.</I>\r\nDetails are available in <A HREF=\"http://linuxtoday.com/news_story.php3?ltsn=2001-02-26-011-04-SC-RH\">\r\nthe RedHat Advisory</A>, both RedHat 6.2 and 7.0 have updates available.',1,'News'),(68,'Update to Compaq TestDrive Program','2001-03-09 17:20:36','Two new applications have been added to Compaq\'s test drive site, providing\r\nfree, online access to these technologies on Alpha Linux platforms.  The\r\nInformix Dynamic Server 2000 is deployed on AlphaServer ES40 running SuSE\r\nLinux.  The recent beta version of Java 2 SDK (version 1.3.1) for Alpha\r\nLinux is also hosted on the site, \r\n<A HREF=\"http://www.testdrive.compaq.com\">http://www.testdrive.compaq.com</A>.\r\n',1,'News'),(69,'New Performance Tips Documentation','2001-03-11 13:33:34','Thanks to Paul Drongowski and <A HREF=\"http://www.compaq.com\">Compaq</A>\r\nwe now have some <A HREF=\"http://www.alphalinux.org/docs/perf.html\"> new\r\nperformance tips</A> for C programmers on AlphaLinux.\r\n<P>\r\n<I>This technical note describes some considerations and techniques to take into account when building computationally intensive applications for Linux on Alpha. It provides a little\r\nbackground on the Alpha architecture and goes on to describe compiler options and coding practices that will help you to get the most from Alpha. We will use a small example program\r\nto illustrate. </I>\r\n',1,'News'),(70,'SuSe 7.1 Beta for Alpha AXP','2001-03-14 14:37:28','Two iso images can be found on SuSe ftp server:\r\n<A HREF=\"ftp://ftp.suse.com/pub/suse/axp/7.1-beta/\">\r\nftp://ftp.suse.com/pub/suse/axp/7.1-beta/</A>. \r\n',1,'News'),(72,'Security: RedHat Updates to slrn, sgmltools and mutt','2001-03-15 11:20:46','slrn:<BR>\r\n<I>An overflow exists in the slrn pacakge as shipped in Red Hat Linux\r\n7 and Red Hat Linux 6.x, which could possibly lead to remote users\r\nexecuting arbitrary code as the user running slrn.</I>\r\n<P>\r\nsgmltools:<BR>\r\n<I>Insecure handling of temporary file permissions could lead to other users\r\non a multi-user system being able to read the documents being converted.</I>\r\nUpdates are available for 5.2, 6.2 and 7.0.\r\n<P>\r\nmutt:<br>\r\n<I>New mutt packages are available. These packages fix an\r\ninstance of the common \'format string\' vulnerability,\r\nand correct an incompatibilty with the current errata\r\nIMAP server.</I>Updates are available for 5.2, 6.2 and 7.0.',1,'News'),(76,'Security: SuSE Updates to imapd, ftpd and timed','2001-03-22 17:33:51','In SuSE 6.1 impad, ipop2d and ipop3d are vulnerable to several \r\nbuffer overflows. In SuSE versions from 6.1 to 7.1 ftpd is vulnerable\r\nto a one-byte buffer overflow and timed has a problem that could\r\nlead to a system crash. Updates are available from <A HREF=\"  ftp://ftp.suse.com/pub/suse/axp/update/\">\r\n  ftp://ftp.suse.com/pub/suse/axp/update/</A>',1,'News'),(78,'Security: SuSE Updates to joe and eperl','2001-03-28 11:35:05','A /tmp problem has been found with the joe packages in SuSE\r\n6.1 through 7.1. Several buffer overflows have been found in eperl \r\nfrom SuSE 6.3 through 7.1 (eperl was not shipped before 6.3). Updates\r\nare available from <A HREF=\"ftp://ftp.suse.com/pub/suse/axp/update\">\r\nSuSE\'s ftp site</A>.\r\n',1,'News'),(89,'Compaq to Offer Linux Advanced Developer\'s Kit for AlphaServer GS Series Systems','2001-04-20 18:18:34','<I><P>Strengthening its position as the leader in Linux computing, Compaq\r\n                                Computer Corporation (NYSE: CPQ) announced today that it is offering Linux developers an\r\n                                Advanced Developer\'s Kit (ADK) for use with its high-end AlphaServer GS Series systems. \r\n<P>\r\n                                Developed in close collaboration with the Linux community, the developer\'s kit provides both\r\n                                documentation and software, including the recommended tools and patches required for running\r\n                                the Linux 2.4 kernel with either SuSE 7.0 or Red Hat 7.0 on the powerful AlphaServer GS systems. \r\n</I>\r\n<P>\r\nMore details at <A HREF=\"http://www.compaq.com/newsroom/pr/2001/pr2001041902.html\">http://www.compaq.com/newsroom/pr/2001/pr2001041902.html</A>.',1,'News'),(82,'Compaq C++ V6.3A  Beta for Linux Alpha','2001-04-02 20:49:02','Compaq C   V6.3A for Linux Beta kit is now available. The new features of this kit include:\r\n<UL>\r\n<LI> Improved code generation</LI>\r\n<LI> cname header support</LI>\r\n<LI> Better locale support in compiler</LI>\r\n<LI> Support for the upcoming Red Hat 7.1 and SuSE 7.x releases</LI>\r\n<LI> 32-bit pointer (TASO) support (Red Hat 7.0 or later)</LI>\r\n</UL>\r\n\r\nThe kit is available from:\r\n<A HREF=\"ftp://ftp.compaq.com/pub/products/C-CXX/linux/compaq_cxx_beta/docs/cxx/index.htm\">\r\nftp://ftp.compaq.com/pub/products/C-CXX/linux/compaq_cxx_beta/docs/cxx/index.htm</A>.\r\n',1,'News'),(80,'Sale of 3x DEC Alpha Personal Workstation 433a','2001-03-29 12:41:04','We have 3x DEC Alpha 433a\'a for sale.\r\nThey are all identical with the following spec:-\r\n<P>\r\n<UL>\r\n<LI>128Mb Ram</LI>\r\n<LI>2Mb Cache</LI>\r\n<LI>2Gb Ultra Scsi HD</LI>\r\n<LI>8Mb Accelgraphics Graphics Card</LI>\r\n<LI>10Bt Network Card</LI>\r\n<LI>CD-Rom</LI>\r\n<LI>Floppy Drive</LI>\r\n<LI>433Mhz CPU</LI>\r\n</UL>\r\n<P>\r\nAnyone interested contact Gareth at gswaffield@gleason.com',1,'News'),(85,'Security: Suse Updates for xntpd, vim/gvim and mc','2001-04-10 12:43:33','<UL>\r\n<LI><B>xntpd:</B></LI>\r\n<LI>An exploit published by Przemyslaw Frasunek demonstrates a buffer\r\n    overflow in the control request parsing code. The exploit allows a\r\n    remote attacker to execute arbitrary commands as root.</LI>\r\n<LI><B>vim/gvim</B></LI>\r\n<LI>The text editor vim, Vi IMproved, was found vulnerable to two security\r\n    bugs: a tmp race condition and vim commands in regular files will be executed if the status line\r\n        of vim is enabled in vimrc</LI>\r\n<LI><B>mc</B></LI>\r\n<LI>A local attacker could trick mc(1) into executing commands with\r\n    the privileges of the user running mc(1) by creating malicious\r\n    directory names. This attack leads to local privilege escalation.</LI>\r\n</UL>Updates are available from <A HREF=\\\"ftp://ftp.suse.com/pub/suse/axp/update\\\">\r\n   ftp://ftp.suse.com/pub/suse/axp/update</A>.',1,'News'),(87,'Security: SuSE Updates to Nedit and Sudo','2001-04-20 11:20:03','Updates are available for SuSE 6.3, 6.4 and 7.0 for the Nedit and\r\nSudo packages due to security issues. Updates can be downloaded from\r\n<A HREF=\"ftp://ftp.suse.com/pub/suse/axp/update\">ftp://ftp.suse.com/pub/suse/axp/update</A>.\r\n<UL>\r\n<LI><B>nedit:</B></LI>\r\n<LI>The Nirvana Editor, NEdit, is a GUI-style text editor based on popular\r\n    Macintosh and MS Windows editors.\r\n    When printing a whole text or selected parts of a text, nedit(1) creates\r\n    a temporary file in an insecure manner. This behavior could be exploited\r\n    to gain access to other users privileges, even root.</LI>\r\n<LI><B>sudo:</B></LI>\r\n<LI>The setuid application sudo(8) allows a user to execute commands under\r\n    the privileges of another user (including root).\r\n    sudo(8) previous to version 1.6.3p6 is vulnerable by a buffer overflow\r\n    in it\'s logging code, which could lead to local root compromise.</LI>\r\n</UL>',1,'News'),(88,'Security: SuSE Update to HylaFax','2001-04-20 11:18:50','<I>The HylaFax program hfaxd(8c) implements the server part of the\r\n    HylaFax package. It is started either by inetd(8) or runs in\r\n    standalone mode. hfaxd(8c) offers three different protocols to\r\n    process fax jobs.\r\n    When hfaxd(8c) tries to change to it\'s queue directory and fails,\r\n    it prints an error message via syslog by directly passing user\r\n    supplied data as format string. As long as hfaxd(8c) is installed\r\n    setuid root, this behavior could be exploited to gain root access\r\n    locally.</I><BR>\r\nUpdates are available from <A HREF=\"ftp://ftp.suse.com/pub/suse/axp/update\">  ftp://ftp.suse.com/pub/suse/axp/update</A>.',1,'News'),(95,'SuSE 7.1 Alpha RC available','2001-05-04 15:33:15','SuSE made their release candidate for the 7.1 Alpha version available on their \r\nftp server. Check out <A HREF=\"ftp://ftp.suse.com/pub/suse/axp/7.1-beta/iso.rc/\">ftp://ftp.suse.com/pub/suse/axp/7.1-beta/iso.rc/</A>.',1,'News'),(100,'KDE 2.1.1 for RH 7.0','2001-05-19 19:28:10','Available now at <A HREF=\"ftp://ftp.alphalinux.org/pub/kde2/rh-7.0/\">ftp://ftp.alphalinux.org/pub/kde2/rh-7.0/</A>. RPMS, SRPMS, and\r\nMD5 checksums. Don\'t forget to visit your favorite <A \r\nHREF=\"http://www.alphalinux.org/mirrors/\">ALO mirror</A>. Thanks to\r\nLaurent Jacques for putting this all together.\r\n',1,'News'),(102,'Special Offer on Red Hat Deluxe 7.0 for Alpha -- $29!!','2001-05-22 17:37:40','Special Limited Quantity Offer - Regularly priced at $79, \r\nCompaq has a limited quantity of the Deluxe Edition of Red Hat 7.0 \r\nfor Alpha available at $29! The kit includes 90 days telephone and \r\nweb-based support from Red Hat and a 90 days trial of the Red Hat \r\nNetwork.<P>\r\n\r\nIn US, purchase direct from Compaq\'s Fortran E-Store \r\n<A HREF=\"http://www.e-softwarefactory.com/acb/webpage.cfm?WebPage_ID=205&DID=34\">\r\nhttp://www.e-softwarefactory.com/acb/webpage.cfm?WebPage_ID=205&DID=34</A>.  Available outside the US from Compaq\'s resellers and distributors.\r\n',1,'News'),(103,'SuSE 7.1 for Alpha to ship by the end of May','2001-05-22 17:38:31','<I>Nuremberg, Germany - May 17, 2001 - Today, SuSE Linux, the\r\n   international technology leader and solutions provider in Open Source\r\n   operating system, announced that SuSE Linux 7.1 for Compaq\'s\r\n   AlphaServer systems will be available by the end of May. By porting the\r\n   latest SuSE distribution to Compaq\'s 64-bit technology, SuSE proves\r\n   itself again as a leading provider of Linux server solutions. Apart from\r\n   the Alpha platform, SuSE Linux also supports Intel and PowerPC CPUs\r\n   as well as the SPARC and S/390 architectures. </I>\r\n<P>Full press release available at <A HREF=\"http://linuxpr.com/releases/3731.html\">\r\nhttp://linuxpr.com/releases/3731.html</A>.',1,'News'),(107,'Security: SuSE Update to man','2001-05-30 12:51:47','<I>Two vulnerabilities have been found in the man package that is installed\r\n                       by default in all SuSE Linux distributions. The first error is a format\r\n                       string bug in the error handling routine of the man command that can\r\n                       allow a local attacker to gain the privileges of the user \"man\" on SuSE\r\n                       Linux systems (the man command in /usr/bin is installed setuid man).\r\n                       After getting write access to the /usr/bin/man binary, an attacker can\r\n                       place a cuckook\'s egg into the executable, waiting for root to view\r\n                       manpages.</I><P><I>\r\n                       The second problem is a segmentation fault that can be caused by the\r\n                       options \"-S ::: foo\" to the man command. On other Linux distributions,\r\n                       this problem has been found exploitable. On SuSE and Debian systems, the\r\n                       code responsible for the bug is different from the one found in other\r\n                       distributions and is not exploitable. We consider the existence of this\r\n                       bug a beauty flaw that will be fixed in future releases of the SuSE Linux\r\n                       distribution, but the fix was not included in the man packages that can\r\n                       be found on our ftp server.</I>\r\n<P>Updates are available from <A HREF=\" ftp://ftp.suse.com/pub/suse/axp/update\">\r\n ftp://ftp.suse.com/pub/suse/axp/update</A>.',1,'News'),(106,'SuSE Linux 7.1 Alpha Edition released','2001-05-29 10:05:32','<A HREF=\"http://www.suse.com/\">SuSE</A> have released version 7.1 Alpha Edition. \r\n<P><I>\r\nThe system offers professional Linux solutions for virtually any utilization\r\narea. Apart from Internet and network tools, SuSE Linux 7.1 Alpha Edition comes with\r\na wide range of database applications, development tools, office and image processing\r\nsoftware, and window managers. A user may select among two graphical user interfaces,\r\nKDE 2.1 or GNOME 1.2. \r\n<P>\r\nThe combined installation and configuration program YaST2 has been equipped with a\r\nnumber of additional configuration and administration features. ATI and Matrox graphics\r\nchipsets now benefit from the improved performance of XFree86 4.0.2. The installation\r\ntool SaX2 facilitates the setup of graphics cards. The user is provided with all boot\r\nloaders for Linux on AlphaServer systems - Milo 2.2, APB, and Aboot 0.7a. Compilers\r\nfor Compaq C, C  , and Fortran, and the respective math libraries are also included.\r\n\r\nSuSE Linux 7.1 Alpha Edition will be delivered on 6 CDs with a 500-page manual.\r\nThe 60-day installation support, which is included in the purchase price, provides\r\nassistance for the installation.\r\n</I>\r\n<P>\r\nThere\'s more information in the <A HREF=\"http://www.suse.com/us/suse/news/PressReleases/7_1_Alpha.html\">\r\npress release</A>. ',1,'News'),(109,'LAM 6.5.2 ported to Alpha Linux','2001-06-01 21:02:02','LAM (Local Area Multicomputer) is an MPI programming environment and development system for\r\nheterogeneous computers on a network. With LAM, a dedicated cluster or an existing network\r\ncomputing infrastructure can act as one parallel computer solving one problem.  The LAM Team at Notre Dame recently \r\ncompleted a port to Alpha Linux.  More info on LAM and access to downloads is at \r\n<A HREF=\"http://www.lam-mpi.org/6.5/\">http://www.lam-mpi.org/6.5/</A>.',1,'News'),(112,'Mozilla release 0.9.1 available for Alpha Linux','2001-06-11 14:56:08','Mozilla RPMs for RedHat 6.x and 7.x are available from\r\n<A HREF=\"http://ftp.mozilla.org/pub/mozilla/releases/mozilla0.9.1/\">\r\nhttp://ftp.mozilla.org/pub/mozilla/releases/mozilla0.9.1/</A>.',1,'News'),(113,'Compaq Affirms Linux Affinities, Announces Initiatives','2001-06-19 15:17:44','<I>Compaq yesterday affirmed its affinities with Linux by announcing a handful of new\r\n                    programs including a \"Tru64 Affinity Program\" that aims to provide application and\r\n                    management compatibility between machines running in a mixed Tru64/Linux\r\n                    environment, and by making its \"single system image\" technology (SSI) available to\r\n                    Linux under a \"GPL-like\" license. </I>\r\n<P>More details are available at <A HREF=\" http://linuxtoday.com/news_story.php3?ltsn=2001-06-19-005-20-NW-BZ\">\r\nthis article</A> in linuxtoday.com.',1,'News'),(114,'Compaq Makes Play for Sun Base with Linux','2001-06-20 07:41:16','<I>Compaq is close to finishing a piece of software it\'s been\r\n     developing secretly to make it easier for Solaris developers to port\r\n     their applications to Linux. It?s going to open source the stuff.\r\n</I><P><I>\r\n     The move is a play to use Linux to hijack Sun customers and get\r\n     them to switch to Compaq\'s widely rejected Unix-based Alpha gear\r\n     or, failing that, to Compaq\'s Intel hardware. Compaq is rated the\r\n     market leader in mainstream Linux server shipments. </I>\r\n<P>\r\nThe full text can be found in this <A HREF=\"http://www.linuxgram.com/article.pl?sid=01/06/19/1353209&section=newsflash\">\r\npress release</A>.',1,'News'),(115,'RedHat 7.1 Released for Alpha','2001-06-23 12:00:12','<A HREF=\"http://www.redhat.com\">RedHat</A> version 7.1 for Alpha\r\nhas started appearing on <A HREF=\"ftp://ftp.redhat.com\">ftp.redhat.com</A>\r\nand <A HREF=\"http://www.redhat.com/mirrors.html\">mirrors</A>. <B>[Update]</B>\r\n<A HREF=\"http://www.redhat.com\">RedHat</A> has now closed off access to the\r\n7.1 alpha tree and asked all mirrors to do the same. There seems to be some\r\nproblem with the distribution.',1,'News'),(116,'Alphalinux.org unavailable','2001-06-24 07:59:50','As many people have noticed www/ftp.alphaliunx.org disappeared several days ago. \r\nLuckily we were in the process of setting up a mirror at the time. All of the website should\r\nbe available here. The FTP site should be setup in a week or so. <B>[Update]</B> www \r\nand ftp.alphalinux.org are now back. There\'s still a mirror available at www.linuxalpha.org.',1,'News'),(117,'Alpha To Be Sold To Intel','2001-06-25 08:11:47','<P><I>\"                 In a bold move that promises to change the landscape of\r\n                       high-performance enterprise computing, Compaq and Intel\r\n                       have committed to work together to accelerate the\r\n                       adoption of Itanium[tm] -based computing in the enterprise\r\n                       marketplace. (press release) Compaq will standardize its\r\n                       64-bit enterprise server product lines on the Itanium[tm]\r\n                       Processor Family and bring all of its operating systems,\r\n                       middleware, and application portfolios to the Itanium[tm]\r\n                       architecture.\"</I>\r\n<P>\r\nMore information can be found at the <A HREF=\"http://www.compaq.com/hps/ipf-enterprise/index.html\">\r\nCompaq Website</A>.\r\n',1,'News'),(118,'Mozilla release 0.9.2 available for Alpha Linux','2001-07-03 07:27:04','Mozilla RPMs for RedHat 6.2 and 7.x releases are available from\r\n<A HREF=\"http://ftp.mozilla.org/pub/mozilla/releases/mozilla0.9.2/\">\r\nhttp://ftp.mozilla.org/pub/mozilla/releases/mozilla0.9.2/</A> in the\r\nRed_Hat_6x_RPMS or Red_Hat_7x_RPMS directories.',1,'News'),(119,'RedHat 7.1 released for Alpha [Update]','2001-07-03 07:24:06','Access to the 7.1 alpha tree is free again. Users can download it\r\nfrom <A HREF=\"ftp://ftp.redhat.com\">ftp.redhat.com</A> or any\r\nof the <A HREF=\"http://www.redhat.com/mirrors.html\">mirrors</A>.',1,'News'),(120,'MILO 2.2.18 Released','2001-07-24 14:54:02','This release, Milo 2.2-18, has some new features and has a fixed Makefile so it should work on machines that hung after \"swapping to palcode @\"\r\n<P>\r\nSome of the changes are:\r\n<UL>\r\n  <LI> Added support for putting MILO into the DEC UDB flash rom.\r\n  <LI> Created new utility (makeflash) that will write a UDB compatible\r\n    flash image suitable for burning into flash using the SRM \"update\"\r\n    command.\r\n  <LI> Added configuration options to remove support for some filesystems\r\n    to make milo smaller so that it can fit into the \"arc\" flash position\r\n    (256k). (you need at least one filesystem to boot your kernel from)\r\n  <LI> Init video and keyboard only if MINI_SERIAL_IO is not defined.\r\n  <LI> Fixed fmu for AlphaPC LX164\r\n  <LI> Fixed bogomips calculation to use loops_per_jiffy instead of\r\n    loops_per_sec\r\n  <LI> Added reiserfs (3.6.x) support.\r\n</UL>\r\n\r\n<P>It\'s currently available from <A  HREF=\"http://www.suse.de/~stepan/\">www.suse.de/~stepan</A>\r\n',1,'News'),(121,'Security: SuSE Update To xli/xloadimage','2001-07-24 15:07:01','<I>xli, aka xloadimage, a image viewer for X11 is used by Netscape\'s plugger\r\n  to display TIFF-, PNG- and Sun-Raster-images. The plugger configuration\r\n  file is /etc/pluggerrc.\r\n  Due to missing boundary checks in the xli code a buffer overflow could be\r\n  triggered by an external attacker to execute commands on the victim\'s\r\n  system. An exploit is publically available.</I>  \r\n<P>Updates are availabel from <A HREF=\"ftp://ftp.suse.com/pub/suse/axp/update\">\r\nftp://ftp.suse.com/pub/suse/axp/update</A>.',1,'News'),(128,'Debian Planet Article on AlphaLinux','2002-02-20 16:06:53','<i><I>This article describes how to have fun and impress your friends by obtaining old Alpha workstations and installing Debian GNU/Linux on them. I\'ll be installing \"potato\" (2.2.R3) on my AlphaStation 250. This is a 1995-vintage workstation with an Alpha CPU. It\'s the main application/DNS/NFS/DHCP seThis article describes how to have fun and impress your friends by obtaining old Alpha workstations and installing Debian GNU/Linux on them. I\'ll be installing \"potato\" (2.2.R3) on my AlphaStation 250. This is a 1995-vintage workstation with an Alpha CPU. It\'s the main application/DNS/NFS/DHCP server on my home network, and is presently my favorite machine. I had been running RedHat on it, but after seeing \"apt-get dist-upgrade\" run for the first time earlier this year, I\'ve been upgrading all my boxes to Debian. rver on my home network, and is presently my favorite machine. I had been running RedHat on it, but after seeing \"apt-get dist-upgrade\" run for the first time earlier this year, I\'ve been upgrading all my boxes to Debian. </i>\r\n<p>Full text at <a href=\"http://www.debianplanet.org/article.php?sid=605\">http://www.debianplanet.org/article.php?sid=605</a>',1,'News'),(126,'SuSE Update To OpenSSH','2001-12-03 10:03:17','<I>The OpenSSH daemon shipped with SuSE distributions contains various minor\r\n    bugs which allows bypassing of IP-access control in some circumstances or\r\n    the deletion of files named \"cookies\" if X11 forwarding is enabled.\r\n    It has also been verified that the recent remotely exploitable crc32 bug as\r\n    well as the logging-bug has been fixed in our latest ssh packages.\r\n    We strongly recommend to update to OpenSSH version 2.9.9p2. Please download\r\n    and update the packages</I>\r\n<p>Updates are available for version 6.4, 7.0 and 7.1 from \r\n<a href=\"ftp://ftp.suse.com/pub/suse/axp/update\">ftp://ftp.suse.com/pub/suse/axp/update</a>.',1,'News'),(129,'New MILOs available for XLT,PC164 and Ruffian','2002-05-01 11:50:54','Available for anonFTP at:\r\n<a href=\"ftp://gatekeeper.dec.com/pub/DEC/Linux-Alpha/TESTING/\">\r\n        ftp://gatekeeper.dec.com/pub/DEC/Linux-Alpha/TESTING/</a>\r\n<p>\r\nyou\'ll find floppy images of MILOs for:\r\n<ul>\r\n<li>        XLT (aka XL300/XL366, EV5 CPUs only)\r\n<li>        PC164 (not LX nor SX)\r\n<li>        Ruffian (aka UX)\r\n</ul>\r\n<p>\r\nThese MILOs are based on Stefan Reinauer\'s <stepan@suse.de> latest\r\nMILO code (2.2-18) and LINUX kernel (2.2.19) patches, found at:\r\n<a href=\"http://www.suse.de/~stepan\">\r\n        http://www.suse.de/~stepan</a>\r\n<p>\r\nThey contain enhancements in the areas of:\r\n<ol>\r\n<li> They work on XLT and PC164 :-)\r\n<li> they can deal with the so-called sparse superblock EXT2 partitions (ie partitions larger than ~2GB in size, which require a blocksize larger than 1K)\r\n</ol>\r\n<p>\r\nPatch sets for the changes are in the process of being mirrored to\r\ngatekeeper, and should appear within the next day or so.\r\n',1,'News'),(122,'Java2 SDK 1.3.1 for Alpha Linux out of Beta and now available','2001-07-27 17:45:45','The Compaq Java Engineering team today released the final version of the Compaq J2SDK/JRE v 1.3.1 for Linux® Alpha systems. \r\nThe J2SDK v 1.3.1-1 kit is available for Red Hat Linux® 6.2 and 7.1, and SuSE® 6.4, 7.0, and 7.1.\r\n\r\nFor more information and to download these software kits, visit the <A HREF=\"http://www.compaq.com/java/alpha\">Compaq \'Java for Alpha Systems\'</a> web site.\r\n\r\n',1,'News'),(124,'Code Forge IDE v2.0 now available for Linux/Alpha!','2001-10-27 13:16:39','Code Forge, Inc is proud to announce the release of Code Forge Integrated Development Environment v2.0 for Linux/Alpha. The IDE features project management and the complete edit/compile/debug cycle for over 30 programming languages. New in version 2.0:\r\n<UL>\r\n<LI> Team Development Support. \r\n<LI> Revision Control support for: CVS, SCCS, PRCS, Perforce and RCS. \r\n<LI> New Revision Control Tool transparent access to all the supported types of RC. Branch support. CVS tag support. \r\n<LI> New Search/Replace Tool - Revision Control aware, searches files as well as ETAGS files. \r\n<LI> Automatic ETAGS gathering at the project level. Selecting a symbol in the editor and pressing alt-. will cause the editor to jump to the definition of the symbol. \r\n<LI> New merge/diff tool - allows on-the-fly editing of merge results with the built-in editor (auto-indentation, syntax highlighting, etc for all supported languages). \r\n<LI> Rename of files/objects within a project _AND_ in RC Repositories. \r\n<LI> New automatic-dependency gathering for C/C   and FORTRAN. \r\n<LI> Querix 4gl and eRuby support. \r\n<LI> MUCH MUCH MORE! \r\n\r\n<P>   Please visit us at www.codeforge.com for more information and to download an evaluation version. (FreeWare version also available). Your feedback is very welcome!\r\n\r\n<P>   Best Regards,\r\n<br>   Yuri Mironoff\r\n<br>   Code Forge, Inc\r\n<br>   http://www.codeforge.com',1,'Press'),(127,'Project UDI on AlphaLinux','2002-02-02 17:37:47',' Project UDI on LINUX for ALPHA is available | 2001-12-20 17:20:13 | Project UDI and STG had annonunced that UDI (Uniform Driver Interface) on LINUX for ALPHA is available. UDI enable the same device driver source code to be used on various Operating Systems and Multiple platforms. <p>\r\n<a href=http://www.stg.com/udiforlinux.html>www.stg.com/udiforlinux.html</a>\r\n<p>\r\n<a href=http://www.projectudi.org>www.projectudi.org</a>',1,'News'),(123,'Compaq CC 6.4.9.005-1','2001-08-02 09:14:50','CCC The Compaq C Compiler is available at version 6.4.9.005-1 under:\r\n<A HREF=\"ftp://ftp.compaq.com/pub/products/C-CXX/linux/compaq_c\">\r\nftp://ftp.compaq.com/pub/products/C-CXX/linux/compaq_c</a>\r\nnotable in this version is support for 32 bit pointers and 32 bit address space under the right versions of binutils.  The links on Compaq\'s webisite still point to the old version .',1,'News'),(125,'Microway To Take Over API Support and Sales','2001-10-27 13:22:17','According to <a href=\"http://www.api-networks.com/pressreleases/pr102501.shtml\">\r\nthis press release</a> on API\'s website <a href=\"http://www.microway.com\">\r\nMicroway</a> is to become \"the exclusive sales and service provider of API NetWorks\' Alpha-based product line\".',1,'News'),(130,'RedHat 7.2 for Alpha Available','2002-06-10 12:26:28','<P>I am please to be able to tell you, that RedHat 7.2 for Alpha is finally ready and will be officially announced tomorrow at:\r\n<P>\r\n<a href=\"http://www.support.compaq.com/alpha-tools/redhat\">\r\nhttp://www.support.compaq.com/alpha-tools/redhat</a>\r\n\r\n<p>I have just setup up one of the official mirror sites at:\r\n\r\n<a href=\"ftp://alpha.crl.dec.com/pub/linux/redhat/7.2-alpha/release-isos/\">\r\nftp://alpha.crl.dec.com/pub/linux/redhat/7.2-alpha/release-isos/</a>\r\n\r\n<p>This mirror site needs to be tested.  We were hoping that some of the members \r\nof the AXP list would like to test this mirror by downloading the ISO images. \r\n:-)\r\n\r\n<p>If this test mirror site becomes busy, please do not mirror these ISO images \r\nwithout making some arrangements John.Goshdigian [AT] hp.com or myself.  The \r\nstatistics from these downloads will be used to determine the coarse of \r\nfuture Alpha releases / distributions.  A list of mirrors will be available \r\ntomorrow from the \"support\" (see: above) web site.\r\n\r\n<P>At this time HP (not RedHat) will be providing the support for this \r\ndistribution.  Please report any problems or bugs to:\r\n\r\n   <a href=\"http://alpha.crl.dec.com/bugzilla\">http://alpha.crl.dec.com/bugzilla</a>\r\n\r\n<p>George France ',1,'News'),(141,'documented samba bug and fix on Linux/Alpha machines','2003-06-03 07:13:54','The following web page documents a bug and patch to Samba that corrupts the time stamp on \r\nfiles accessed by Windows machines stored on the samba host.  The bug is unique to Alpha \r\nmachines and is present in all versions of samba.  The simple patch has corrected this \r\nproblem for my Debian/Alpha/Stable machines and should fix all versions of samba on the \r\nAlpha.\r\n<BR>\r\n<a href=\"http://bugs.debian.org/cgi-bin/bugreport.cgi?bug=194075\">\r\nhttp://bugs.debian.org/cgi-bin/bugreport.cgi?bug=194075</a>\r\n',1,'News'),(133,' Linux Super Page kernel patch for Alpha','2002-06-26 09:13:40','<p>I finally got stable version of Linux Super Page Kernel for Alpha.\r\nIt is a kernel patch against linux-2.2.21, and it will activate\r\nAlpha processor\'s Page Granularity Hints bit of their DTB(DataTLB).\r\nI got about 4 to 5 times faster result on the Super Paged kernel\r\nthan on the normal kernel with a matrix transpose benchmark.\r\nIt may help some people to accelarate their programs.\r\nSee more:\r\n<P><A href=\r\nhttp://shimizu-lab.dt.u-tokai.ac.jp/lsp.html>\r\nhttp://shimizu-lab.dt.u-tokai.ac.jp/lsp.html<a>\r\n<p>\r\nI placed latest version of the super page kernel patch on the web.\r\n<br>\r\nRegards,\r\n<br>\r\nNaohiko Shimizu.',1,'News'),(134,'Debian GNU/Linux 3.0 released!','2002-07-22 09:48:28','Debian GNU/Linux 3.0 `Woody\' was released on 19 July 2002.  \r\n<P>\r\n<a href=\"http://www.debian.org/News/2002/20020719\">http://www.debian.org/News/2002/20020719</a>\r\n<p>\r\nFrom the release: `Debian GNU/Linux is a free operating system, which now supports a total of eleven processor architectures, includes KDE and GNOME desktop environments, features cryptographic software, is compatible with the FHS v2.2 and supports software developed for the LSB.\'\r\n<P>\r\nOf course, Alpha is one of the eleven processor architectures supported ;-)\r\n',1,'News'),(135,'Slackware 8.1 Alpha port','2002-07-24 10:01:36','Slackware is working on a alpha port of the 8.1 release. \r\nhttp://www.slackware.com/ports/alpha/',1,'News'),(136,'Firmware Archive for  API Networks Systems','2002-08-02 15:11:32','<a href=\"http://www.linuxalpha.org/firmware/api/\">http://www.linuxalpha.org/firmware/api/</a>\r\n<p>\r\nThis is an archive of the latest released firmware, software and supporting documents for all API NetWorks systems. It\'ll will probably remain a static archive since there is no one currently able to continue the support for SRM on these platforms. ',1,'News'),(137,'Gentoo releases Alpha port','2002-09-23 14:37:59','We are proud to announce Gentoo Linux for the Alpha processor! In a testament to the power and flexibility of the Portage system and Gentoo Linux, Bjoern Brauel (aka \"bjb\") has done the amazing job of creating a whole new port for Gentoo Linux in the span of 2 (yes, TWO) days (yes, DAYS). More information at <A href=\"http://www.gentoo.org\">www.gentoo.org</a>.',1,'News'),(138,'EV7 AlphaServers unleashed as chip line heads into sunset','2003-01-22 09:55:25','<p><i>Customers of Hewlett-Packard Co\'s AlphaServer RISC machines got a look at the probable future machines they will use over the next few years as HP rolled out the \"Marvel\" line of servers, writes Timothy Prickett-Morgan. The Marvels, which are based on the Alpha EV7 processor, are kickers to the current \"Wildfire\" series of AlphaServer machines, which are based on the Alpha EV68 processors.</i></p>\r\n<p>Taken from: <a href=http://www.theregister.co.uk/content/3/28947.html>http://www.theregister.co.uk/content/3/28947.html</a>',1,'News'),(140,'[suse-axp] [announce] SuSE Linux 8.1 Alpha Edition available.','2003-05-14 09:13:48','Dear Alpha community,\r\n<P>\r\nit\'s been quite some spare time nights that the old SuSE Alpha Team\r\nspent to present you a new version of SuSE Linux for Alpha machines.\r\n<P>\r\nTo safe more greasy words: It\'s available for download from \r\n      ftp://ftp.suse.com/pub/suse/axp/supplementary/8.1/ \r\n<P>\r\nThere are quite a couple of reasons to update now, among them are:\r\n<P>\r\n<ul>\r\n<li> kernel 2.4.19\r\n<li> gcc 3.2.2, glibc 2.2.5, binutils 2.12.90.0.15\r\n<li> apache2, bind8/9, ..\r\n<li> kde 3.0.4\r\n</ul>\r\n <P>\r\nSuSE Linux 8.1 Alpha Edition has been tested on several EV56/EV6/EV67\r\nmachines, but it might also work on newer/older Alpha systems. \r\n<P>\r\nTo install SuSE Linux 8.1 Alpha Edition on SRM systems, you need to\r\ndownload the installation iso, and burn it to a CD. Find the ISO at  \r\nftp://ftp.suse.com/pub/suse/axp/supplementary/8.1/boot/boot.iso\r\nThen you can start installation with \"boot dkb0 -fl 0\". Please make \r\nsure to insert your cdrom device instead of dkb0. For interactive \r\nstartup you can use the \"-fl i\" instead of \"-fl 0\"\r\nInstallation on Milo systems is a little bit more work. Find a short\r\ndescription and the milo images at\r\nftp://ftp.suse.com/pub/suse/axp/supplementary/8.1/milo/\r\n<P>\r\nPlease note: SuSE Linux 8.1 Alpha Edition comes with absolutely no\r\nwarranty and support whatsoever. We can not provide iso images of the\r\ncomplete distribution at the moment, but ftp installation works fine\r\nhere and should be viable once the distribution arrived on all mirrors.\r\n<P>\r\nFeel free to send bug reports, or hints to the SuSE AXP mailing list \r\nsuse-axp@suse.com. \r\n\r\n',1,'News'),(132,'MITEL SME V5.1.2 PORT FOR ALPHA AT www.e-smith.org','2002-06-24 11:18:43','There is a port of the Mitel (e-smith) Redhat server/gateway OS that has been done by Robert van den Aker available in the contrib <A href=http://www.e-smith.org/cgi-bin/contrib.cgi> area at e-smith</a>.\r\n<p>\r\nRobert\'s HOWTO can be found at <a href=http://www.robert2.dds.nl/howtos/alpha-howto.html>\r\nhttp://www.robert2.dds.nl/howtos/alpha-howto.html</a>.\r\n',1,'News'),(139,'Itanium-2 is far behind Alpha when it comes to SAPS (SAP benchmak)','2003-02-27 11:47:10','http://heise.de/newsticker/data/as-25.02.03-000/ (German)',1,'News'),(142,'Updates for RedHat 7.2 Alpha','2003-07-09 19:03:42','On  ftp://ftp2.compaq.com/pub/linux/RedHat/7.2-alpha/updates/ are:\r\n<P>\r\nUpdated Xpdf package fixes a vulnerability where a malicious PDF document could run arbitrary code.<br>\r\n        https://rhn.redhat.com/errata/RHSA-2003-196.html\r\n<p>\r\nThe new package is:\r\n<br>         xpdf-0.92-9.alpha.rpm\r\n\r\n\r\n<P>Updated ypserv packages fixing a denial of service vulnerability.\r\n<br>        https://rhn.redhat.com/errata/RHSA-2003-173.html\r\n\r\n<P>The new package is:\r\n<BR>        ypserv-2.8-0.72E.alpha.rpm\r\n\r\n\r\n<P>Updated unzip packages resolving a vulnerability allowing arbitrary files to be overwritten.\r\n<br>        https://rhn.redhat.com/errata/RHSA-2003-199.html\r\n\r\n<P>The new package is:\r\n<br>        unzip-5.50-11.alpha.rpm\r\n',1,'News'),(143,'Fedora Alpha port','2003-10-06 11:05:04','- A Fedora Alpha port is near ?\r\n<P>\r\n<a href=\"http://www.redhat.com/archives/fedora-devel-list/2003-October/msg00159.html\">\r\nhttp://www.redhat.com/archives/fedora-devel-list/2003-October/msg00159.html</a>\r\n<P>\r\nMike A. Harris <mharris redhat com> wrote:\r\n<br>\r\nMyself, Jeff Garzik, Richard Henderson, Phil \"Bryce\" Copeland and \r\nvarious people from DEC/COMPAQ/HP have been slowly making evil \r\nplans to work on an alpha port of the current distribution \r\nsometime soon.  We have no details as of yet, but once we are \r\nready to start building and pushing packages we\'ll let people \r\nknow here.  The intent is to make a Fedora/Alpha distribution.\r\n\r\nThat is all the detail I have for now.  When there is more \r\ninformation, we will announce it here.\r\n\r\n',1,'News'),(144,'Please test debian-installer on your alpha','2004-06-08 09:52:50','If you are the proud owner of an alpha, and you\'d like to have a brand new GNU/Linux installation in it, you could help the Debian distribution by testing the new debian-installer.\r\n\r\nYou can download the images from: http://www.debian.org/devel/debian-installer/\r\n\r\nPlease report the results of the installation to debian-boot@lists.debian.org once you\'ve finished.',1,'News'),(169,'CentOS-4.1 (Beta) for the Alpha processor','2005-06-28 14:04:13','From the website.<p>\r\n\"CentOS 2 and 3 are a 100% compatible rebuild of the RHEL 2 and 3 versions, in full compliance with RedHat\'s redistribution requirements. CentOS is for people who need an enterprise class OS stability without the cost of certification and support.\"\r\n<p>\r\nPress release:\r\n<a href=\"http://www.centos.org/modules/news/article.php?storyid=91\">\r\nhttp://www.centos.org/modules/news/article.php?storyid=91</a>',1,'News'),(165,'Debian 3.1 (sarge) has been released: alpha version available','2005-06-08 20:48:48','I have just upgraded my two alpha machines from Woody (3.0) to \r\nSarge (3.1) and all is well.  The upgrade was very smooth and \r\nessentially effortless.  Debian is such a great distribution !',1,'News'),(182,'CentOS 4.2 Released for Alpha','2005-10-27 16:41:56','From the <a href=\"http://www.centos.org\">CentOS website</a>,\r\n<p>\r\n\"The CentOS team is pleased to announce availability of CentOS 4.2. Major new features include the Linux 2.6 Kernel, SELinux, udev replacing the /dev system, Xorg, MySQL4, CyrusIMAPD, Gnome 2.8 and KDE 3.3.These improvements along with many more are detailed in the release notes available online <a href=\"http://mirror.centos.org/centos/4/os/i386/RELEASE-NOTES-en.html\">(http://mirror.centos.org/centos/4/os/i386/RELEASE-NOTES-en.html)</a>\r\n<br>\r\n<br>\r\nThese 6 architectures are complete and released as final:\r\n<br>\r\n<br>\r\nCentOS 4.2 x86_64.<br>\r\nCentOS 4.2 i386.<br>\r\nCentOS 4.2 IA64.<br>\r\nCentOS 4.2 s390<br>\r\nCentOS 4.2 s390x<br>\r\nCentOS 4.2 for Alpha<br>\r\n...<br>\r\n\"<br>\r\n</p>',1,'News'),(160,'AlphaCore 1.0 (FC3) torrent, mirror available','2005-05-10 08:38:19','The just-released AlphaCore 1.0 (a.k.a. Fedora Core 3 for alpha) is now available via BitTorrent and FTP mirror.\r\n<p>\r\nTorrent (preferred):<p>\r\n<a href=\"ftp://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-1.0-ISO.torrent\">ftp://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-1.0-ISO.torrent</a>\r\n<p>\r\nFTP mirror:<p>\r\n<a href=\"ftp://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-1.0-ISO/\">ftp://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-1.0-ISO/ </a>\r\n\r\n\r\n',1,'News'),(154,'Alpha Core 0.9 torrent, mirror available','2005-03-24 10:47:28','Alpha Core 0.9 [Fedora Core 2 port for alpha] is now available at additional download locations:\r\n<p>\r\nBitTorrent (preferred):<p>\r\n<a href=\"http://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-0.9-ISO.torrent\">\r\nhttp://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-0.9-ISO.torrent</a>\r\n<p>\r\nFTP:<p>\r\n<a href=\"http://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-0.9-ISO/\r\n\">http://zeniv.linux.org.uk/pub/distributions/community/alphacore/AC-0.9-ISO/</a>\r\n',1,'News'),(152,'Fedora for Alpha','2005-02-28 15:19:48','Alpha Core is a port of Fedora Core to the Alpha architecture, get it from <a href=\"http://alphacore.info\">http://alphacore.info</a>\r\n\r\n',1,'News'),(155,'Alpha Core 1.0a','2005-04-20 12:48:33','	After a timeout and slow development of alpha core, me [Cristian Balint]\r\nand a new volunteer Sergey Tikhonov, finaly developed next release of alpha core 1.0\r\nwich is equivalent with fedora-FC3 but with lots of alpha specific fixes.\r\n\r\n<P>\r\n	Unfortunatley Mike Barnes haven\'t the time these days to take major part of\r\ndevelopment on this new tree, so we decided to release AlphaCore 1.0a now as-is.\r\n<P>\r\n	The main personality of the tree is the fact the Sergely fixed some important\r\nthreading suport in glibc to switch corectly between nptl and linuxthreads, so application \r\nrun more stable and few bugs present even in 0.9 are gone now. The second major thing \r\nis the kernel, we used 2.6.10 because between 2.6.6<>2.6.10 the mainline kernel was \r\nbroken for alpha, and we disable few things wich are unstable/unusable for alpha arch. \r\nIn rest everything else is fedora specific changes between FC2-->FC3.\r\n<P>\r\n\r\n	We release this under the version \"1.0a\" and plan that \"1.0\" version will be \r\nmarked only on the final iso images.\r\n<P>\r\n	The iso images will be based exact on that curent tree, unless someone discover \r\nsomething showstopper thing to fix, and will try in a mather of 2 weeks to pack it.\r\n<P>\r\nSo, the path to AlphaCore 1.0a tree:<br>\r\n<a href=\"ftp://ftp.rdsor.ro/pub/Linux/Distributions/AlphaLinux/core/1.0a/\">\r\nftp://ftp.rdsor.ro/pub/Linux/Distributions/AlphaLinux/core/1.0a/</A>\r\n<p>\r\n\r\nAnd also there is a yum config file wich point to this tree:<br>\r\n<a href=\"ftp://ftp.rdsor.ro/pub/Linux/Distributions/AlphaLinux/core/yum.conf-1.0a\r\n\">ftp://ftp.rdsor.ro/pub/Linux/Distributions/AlphaLinux/core/yum.conf-1.0a</a>\r\n\r\n<P>	Mirrors are welcome, testers and volunteers are welcome, any feedback suggestions are accounted \r\nin the final iso pack.\r\n',1,'News'),(163,'Alpha CPU\'s history','2005-05-19 13:07:45','Paul V. Bolotoff recently posted a comprehensive history of the Alpha CPU to a mailing list, and I thought the AlphaLinux people might be interested in it:\r\n\r\n<a href=\"http://www.alasir.com/alpha/alpha_history.html\">http://www.alasir.com/alpha/alpha_history.html</A>\r\n\r\n',1,'News'),(233,'AC2 is out','2006-03-09 14:33:24','https://www.redhat.com/archives/axp-list/2006-February/msg00041.html\r\n',1,'News'),(1732,'','2008-11-10 12:16:23','',0,''),(1731,'','2008-11-10 12:16:22','',0,''),(1730,'','2008-11-10 07:14:40','',0,''),(1729,'','2008-11-10 06:39:18','',0,''),(1728,'','2008-11-10 06:28:05','',0,''),(1727,'','2008-11-10 06:13:36','',0,''),(1726,'','2008-11-10 06:13:29','',0,''),(1725,'','2008-11-10 03:49:15','',0,''),(1724,'','2008-11-09 06:49:09','',0,''),(1723,'','2008-11-07 21:24:23','',0,''),(1722,'','2008-11-07 13:15:03','',0,''),(1721,'','2008-11-07 13:14:23','',0,''),(1720,'','2008-11-07 11:29:08','',0,''),(1719,'','2008-11-07 11:23:47','',0,''),(1718,'','2008-11-07 11:23:46','',0,''),(1717,'','2008-11-07 07:15:30','',0,''),(1716,'','2008-11-07 05:54:08','',0,''),(1715,'','2008-11-07 02:01:18','',0,''),(1714,'','2008-11-06 11:44:17','',0,''),(1713,'','2008-11-06 11:34:24','',0,''),(1712,'','2008-11-06 11:34:23','',0,''),(1711,'','2008-11-06 11:33:40','',0,''),(1710,'','2008-11-06 09:12:43','',0,''),(1709,'','2008-11-05 13:18:31','',0,''),(1708,'','2008-11-05 13:14:45','',0,''),(1707,'','2008-11-05 05:15:29','',0,''),(1706,'','2008-11-05 05:11:22','',0,''),(1705,'','2008-11-04 07:00:59','',0,''),(1704,'','2008-11-04 06:58:33','',0,''),(1703,'','2008-11-04 03:59:41','',0,''),(1702,'','2008-11-04 03:05:12','',0,''),(1701,'','2008-11-03 13:15:29','',0,''),(1700,'','2008-11-03 12:13:38','',0,''),(1699,'','2008-11-03 11:51:35','',0,''),(1698,'','2008-11-03 00:00:24','',0,''),(1697,'','2008-11-02 11:41:40','',0,''),(1696,'','2008-11-02 11:40:02','',0,''),(1695,'','2008-11-02 11:38:12','',0,''),(1694,'','2008-11-02 11:36:03','',0,''),(1693,'','2